(6, '2017-09-20 15:39:41', 'USER_INVITE', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', '#SITE_NAME#: Приглашение на сайт', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\nЗдравствуйте, #NAME# #LAST_NAME#!\n\nАдминистратором сайта вы добавлены в число зарегистрированных пользователей.\n\nПриглашаем Вас на наш сайт.\n\nВаша регистрационная информация:\n\nID пользователя: #ID#\nLogin: #LOGIN#\n\nРекомендуем вам сменить установленный автоматически пароль.\n\nДля смены пароля перейдите по следующей ссылке:\nhttp://#SERVER_NAME#/auth.php?change_password=yes&USER_LOGIN=#URL_LOGIN#&USER_CHECKWORD=#CHECKWORD#\n', 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\nЗдравствуйте, <?=$arParams[\"NAME\"];?> <?=$arParams[\"LAST_NAME\"];?>!\n\nАдминистратором сайта вы добавлены в число зарегистрированных пользователей.\n\nПриглашаем Вас на наш сайт.\n\nВаша регистрационная информация:\n\nID пользователя: <?=$arParams[\"ID\"];?>\n\nLogin: <?=$arParams[\"LOGIN\"];?>\n\n\nРекомендуем вам сменить установленный автоматически пароль.\n\nДля смены пароля перейдите по следующей ссылке:\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/auth.php?change_password=yes&USER_LOGIN=<?=$arParams[\"URL_LOGIN\"];?>&USER_CHECKWORD=<?=$arParams[\"CHECKWORD\"];?>\n\n', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ru'),
(7, '2017-09-20 15:39:41', 'FEEDBACK_FORM', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '#SITE_NAME#: Сообщение из формы обратной связи', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nВам было отправлено сообщение через форму обратной связи\n\nАвтор: #AUTHOR#\nE-mail автора: #AUTHOR_EMAIL#\n\nТекст сообщения:\n#TEXT#\n\nСообщение сгенерировано автоматически.', 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\n\nВам было отправлено сообщение через форму обратной связи\n\nАвтор: <?=$arParams[\"AUTHOR\"];?>\n\nE-mail автора: <?=$arParams[\"AUTHOR_EMAIL\"];?>\n\n\nТекст сообщения:\n<?=$arParams[\"TEXT\"];?>\n\n\nСообщение сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'ru'),
(8, '2017-09-20 15:39:50', 'ADV_BANNER_STATUS_CHANGE', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '[BID##ID#] #SITE_NAME#: Изменился статус баннера - [#STATUS#]', 'Статус баннера # #ID# изменился на [#STATUS#].\n\n>=================== Параметры баннера ===============================\n\nБаннер   - [#ID#] #NAME#\nКонтракт - [#CONTRACT_ID#] #CONTRACT_NAME#\nТип      - [#TYPE_SID#] #TYPE_NAME#\nГруппа   - #GROUP_SID#\n\n----------------------------------------------------------------------\n\nАктивность: #INDICATOR#\n\nПериод    - [#DATE_SHOW_FROM# - #DATE_SHOW_TO#]\nПоказан   - #SHOW_COUNT# / #MAX_SHOW_COUNT# [#DATE_LAST_SHOW#]\nКликнули  - #CLICK_COUNT# / #MAX_CLICK_COUNT# [#DATE_LAST_CLICK#]\nФлаг акт. - [#ACTIVE#]\nСтатус    - [#STATUS#]\nКомментарий:\n#STATUS_COMMENTS#\n----------------------------------------------------------------------\n\nИзображение - [#IMAGE_ALT#] #IMAGE_LINK#\nURL         - [#URL_TARGET#] #URL#\n\nКод: [#CODE_TYPE#]\n#CODE#\n\n>=====================================================================\n\nСоздан  - #CREATED_BY# [#DATE_CREATE#]\nИзменен - #MODIFIED_BY# [#DATE_MODIFY#]\n\nДля просмотра параметров баннера воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/adv_banner_edit.php?ID=#ID#&CONTRACT_ID=#CONTRACT_ID#&lang=ru\n\nПисьмо сгенерировано автоматически.\n', 'Статус баннера # <?=$arParams[\"ID\"];?> изменился на [<?=$arParams[\"STATUS\"];?>].\n\n>=================== Параметры баннера ===============================\n\nБаннер   - [<?=$arParams[\"ID\"];?>] <?=$arParams[\"NAME\"];?>\n\nКонтракт - [<?=$arParams[\"CONTRACT_ID\"];?>] <?=$arParams[\"CONTRACT_NAME\"];?>\n\nТип      - [<?=$arParams[\"TYPE_SID\"];?>] <?=$arParams[\"TYPE_NAME\"];?>\n\nГруппа   - <?=$arParams[\"GROUP_SID\"];?>\n\n\n----------------------------------------------------------------------\n\nАктивность: <?=$arParams[\"INDICATOR\"];?>\n\n\nПериод    - [<?=$arParams[\"DATE_SHOW_FROM\"];?> - <?=$arParams[\"DATE_SHOW_TO\"];?>]\nПоказан   - <?=$arParams[\"SHOW_COUNT\"];?> / <?=$arParams[\"MAX_SHOW_COUNT\"];?> [<?=$arParams[\"DATE_LAST_SHOW\"];?>]\nКликнули  - <?=$arParams[\"CLICK_COUNT\"];?> / <?=$arParams[\"MAX_CLICK_COUNT\"];?> [<?=$arParams[\"DATE_LAST_CLICK\"];?>]\nФлаг акт. - [<?=$arParams[\"ACTIVE\"];?>]\nСтатус    - [<?=$arParams[\"STATUS\"];?>]\nКомментарий:\n<?=$arParams[\"STATUS_COMMENTS\"];?>\n\n----------------------------------------------------------------------\n\nИзображение - [<?=$arParams[\"IMAGE_ALT\"];?>] <?=$arParams[\"IMAGE_LINK\"];?>\n\nURL         - [<?=$arParams[\"URL_TARGET\"];?>] <?=$arParams[\"URL\"];?>\n\n\nКод: [<?=$arParams[\"CODE_TYPE\"];?>]\n<?=$arParams[\"CODE\"];?>\n\n\n>=====================================================================\n\nСоздан  - <?=$arParams[\"CREATED_BY\"];?> [<?=$arParams[\"DATE_CREATE\"];?>]\nИзменен - <?=$arParams[\"MODIFIED_BY\"];?> [<?=$arParams[\"DATE_MODIFY\"];?>]\n\nДля просмотра параметров баннера воспользуйтесь ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/bitrix/admin/adv_banner_edit.php?ID=<?=$arParams[\"ID\"];?>&CONTRACT_ID=<?=$arParams[\"CONTRACT_ID\"];?>&lang=ru\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(9, '2017-09-20 15:39:50', 'ADV_CONTRACT_INFO', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '[CID##ID#] #SITE_NAME#: Параметры рекламного контракта', '#MESSAGE#\nКонтракт: [#ID#] #NAME#\n#DESCRIPTION#\n>================== Параметры контракта ==============================\n\nАктивность: #INDICATOR#\n\nПериод    - [#DATE_SHOW_FROM# - #DATE_SHOW_TO#]\nПоказано  - #SHOW_COUNT# / #MAX_SHOW_COUNT#\nКликнули  - #CLICK_COUNT# / #MAX_CLICK_COUNT#\nФлаг акт. - [#ACTIVE#]\n\nБаннеров  - #BANNERS#\n>=====================================================================\n\nСоздан  - #CREATED_BY# [#DATE_CREATE#]\nИзменен - #MODIFIED_BY# [#DATE_MODIFY#]\n\nДля просмотра параметров контракта воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/adv_contract_edit.php?ID=#ID#&lang=ru\n\nПисьмо сгенерировано автоматически.\n', '<?=$arParams[\"MESSAGE\"];?>\n\nКонтракт: [<?=$arParams[\"ID\"];?>] <?=$arParams[\"NAME\"];?>\n\n<?=$arParams[\"DESCRIPTION\"];?>\n\n>================== Параметры контракта ==============================\n\nАктивность: <?=$arParams[\"INDICATOR\"];?>\n\n\nПериод    - [<?=$arParams[\"DATE_SHOW_FROM\"];?> - <?=$arParams[\"DATE_SHOW_TO\"];?>]\nПоказано  - <?=$arParams[\"SHOW_COUNT\"];?> / <?=$arParams[\"MAX_SHOW_COUNT\"];?>\n\nКликнули  - <?=$arParams[\"CLICK_COUNT\"];?> / <?=$arParams[\"MAX_CLICK_COUNT\"];?>\n\nФлаг акт. - [<?=$arParams[\"ACTIVE\"];?>]\n\nБаннеров  - <?=$arParams[\"BANNERS\"];?>\n\n>=====================================================================\n\nСоздан  - <?=$arParams[\"CREATED_BY\"];?> [<?=$arParams[\"DATE_CREATE\"];?>]\nИзменен - <?=$arParams[\"MODIFIED_BY\"];?> [<?=$arParams[\"DATE_MODIFY\"];?>]\n\nДля просмотра параметров контракта воспользуйтесь ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/bitrix/admin/adv_contract_edit.php?ID=<?=$arParams[\"ID\"];?>&lang=ru\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
