(39, '2017-09-20 15:40:50', 'IM_NEW_MESSAGE_GROUP', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '#SITE_NAME#: Мгновенные сообщения от #FROM_USERS#', 'Здравствуйте, #USER_NAME#!\n\nУ вас есть новые мгновенные сообщения от пользователей #FROM_USERS#.\n\n#MESSAGES#\n\nПерейти к диалогам: http://#SERVER_NAME#/?IM_DIALOG=Y\nВы можете изменить настройки уведомлений: http://#SERVER_NAME#/?IM_SETTINGS=NOTIFY\n\nЭто письмо сформировано автоматически.', 'Здравствуйте, <?=$arParams[\"USER_NAME\"];?>!\n\nУ вас есть новые мгновенные сообщения от пользователей <?=$arParams[\"FROM_USERS\"];?>.\n\n<?=$arParams[\"MESSAGES\"];?>\n\n\nПерейти к диалогам: http://<?=$arParams[\"SERVER_NAME\"];?>/?IM_DIALOG=Y\nВы можете изменить настройки уведомлений: http://<?=$arParams[\"SERVER_NAME\"];?>/?IM_SETTINGS=NOTIFY\n\nЭто письмо сформировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(40, '2017-09-20 15:40:52', 'NEW_LEARNING_TEXT_ANSWER', 's1', 'Y', '#EMAIL_FROM#', '#EMAIL_TO#', '#SITE_NAME#: #COURSE_NAME#: #MESSAGE_TITLE#', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nКурс:#COURSE_NAME#\nТест:#TEST_NAME#\n\nПользователь: #USER#\nДата: #DATE#\n\nВопрос:\n------------------------------------------\n#QUESTION_TEXT#\n------------------------------------------\n\nОтвет:\n------------------------------------------\n#ANSWER_TEXT#\n------------------------------------------\n\nДля просмотра и редактирования ответа воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/learn_test_result_edit.php?lang=ru&ID=#ID#&ATTEMPT_ID=#ATTEMPT_ID#\n\nСообщение сгенерировано автоматически.', 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\n\nКурс:<?=$arParams[\"COURSE_NAME\"];?>\n\nТест:<?=$arParams[\"TEST_NAME\"];?>\n\n\nПользователь: <?=$arParams[\"USER\"];?>\n\nДата: <?=$arParams[\"DATE\"];?>\n\n\nВопрос:\n------------------------------------------\n<?=$arParams[\"QUESTION_TEXT\"];?>\n\n------------------------------------------\n\nОтвет:\n------------------------------------------\n<?=$arParams[\"ANSWER_TEXT\"];?>\n\n------------------------------------------\n\nДля просмотра и редактирования ответа воспользуйтесь ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/bitrix/admin/learn_test_result_edit.php?lang=ru&ID=<?=$arParams[\"ID\"];?>&ATTEMPT_ID=<?=$arParams[\"ATTEMPT_ID\"];?>\n\n\nСообщение сгенерировано автоматически.', 'text', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(41, '2017-09-20 15:41:12', 'SALE_NEW_ORDER', 's1', 'Y', '#SALE_EMAIL#', '#EMAIL#', '#SITE_NAME#: Новый заказ N#ORDER_ID#', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"ru\" lang=\"ru\">\n<head>\n	<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\"/>\n	<style>\n		body\n		{\n			font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n			font-size: 14px;\n			color: #000;\n		}\n	</style>\n</head>\n<body>\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"850\" style=\"background-color: #d1d1d1; border-radius: 2px; border:1px solid #d1d1d1; margin: 0 auto;\" border=\"1\" bordercolor=\"#d1d1d1\">\n	<tr>\n		<td height=\"83\" width=\"850\" bgcolor=\"#eaf3f5\" style=\"border: none; padding-top: 23px; padding-right: 17px; padding-bottom: 24px; padding-left: 17px;\">\n			<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n				<tr>\n					<td bgcolor=\"#ffffff\" height=\"75\" style=\"font-weight: bold; text-align: center; font-size: 26px; color: #0b3961;\">Вами оформлен заказ в магазине #SITE_NAME#</td>\n				</tr>\n				<tr>\n					<td bgcolor=\"#bad3df\" height=\"11\"></td>\n				</tr>\n			</table>\n		</td>\n	</tr>\n	<tr>\n		<td width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 16px; padding-left: 44px;\">\n			<p style=\"margin-top:30px; margin-bottom: 28px; font-weight: bold; font-size: 19px;\">Уважаемый #ORDER_USER#,</p>\n			<p style=\"margin-top: 0; margin-bottom: 20px; line-height: 20px;\">Ваш заказ номер #ORDER_ID# от #ORDER_DATE# принят.<br />\n<br />\nСтоимость заказа: #PRICE#.<br />\n<br />\nСостав заказа:<br />\n#ORDER_LIST#<br />\n<br />\nВы можете следить за выполнением своего заказа (на какой стадии выполнения он находится), войдя в Ваш персональный раздел сайта #SITE_NAME#.<br />\n<br />\nОбратите внимание, что для входа в этот раздел Вам необходимо будет ввести логин и пароль пользователя сайта #SITE_NAME#.<br />\n<br />\nДля того, чтобы аннулировать заказ, воспользуйтесь функцией отмены заказа, которая доступна в Вашем персональном разделе сайта #SITE_NAME#.<br />\n<br />\nПожалуйста, при обращении к администрации сайта #SITE_NAME# ОБЯЗАТЕЛЬНО указывайте номер Вашего заказа - #ORDER_ID#.<br />\n<br />\nСпасибо за покупку!<br />\n</p>\n		</td>\n	</tr>\n	<tr>\n		<td height=\"40px\" width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 30px; padding-left: 44px;\">\n			<p style=\"border-top: 1px solid #d1d1d1; margin-bottom: 5px; margin-top: 0; padding-top: 20px; line-height:21px;\">С уважением,<br />администрация <a href=\"http://#SERVER_NAME#\" style=\"color:#2e6eb6;\">Интернет-магазина</a><br />\n				E-mail: <a href=\"mailto:#SALE_EMAIL#\" style=\"color:#2e6eb6;\">#SALE_EMAIL#</a>\n			</p>\n		</td>\n	</tr>\n</table>\n</body>\n</html>', '<!DOCTYPE HTML PUBLIC \"-//W3C//DTD HTML 4.01 Transitional//EN\" \"http://www.w3.org/TR/html4/loose.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\" xml:lang=\"ru\" lang=\"ru\">\n<head>\n	<meta http-equiv=\"Content-Type\" content=\"text/html;charset=UTF-8\"/>\n	<style>\n		body\n		{\n			font-family: \'Helvetica Neue\', Helvetica, Arial, sans-serif;\n			font-size: 14px;\n			color: #000;\n		}\n	</style>\n</head>\n<body>\n<table cellpadding=\"0\" cellspacing=\"0\" width=\"850\" style=\"background-color: #d1d1d1; border-radius: 2px; border:1px solid #d1d1d1; margin: 0 auto;\" border=\"1\" bordercolor=\"#d1d1d1\">\n	<tr>\n		<td height=\"83\" width=\"850\" bgcolor=\"#eaf3f5\" style=\"border: none; padding-top: 23px; padding-right: 17px; padding-bottom: 24px; padding-left: 17px;\">\n			<table cellpadding=\"0\" cellspacing=\"0\" border=\"0\" width=\"100%\">\n				<tr>\n					<td bgcolor=\"#ffffff\" height=\"75\" style=\"font-weight: bold; text-align: center; font-size: 26px; color: #0b3961;\">Вами оформлен заказ в магазине <?=$arParams[\"SITE_NAME\"];?></td>\n				</tr>\n				<tr>\n					<td bgcolor=\"#bad3df\" height=\"11\"></td>\n				</tr>\n			</table>\n		</td>\n	</tr>\n	<tr>\n		<td width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 16px; padding-left: 44px;\">\n			<p style=\"margin-top:30px; margin-bottom: 28px; font-weight: bold; font-size: 19px;\">Уважаемый <?=$arParams[\"ORDER_USER\"];?>,</p>\n			<p style=\"margin-top: 0; margin-bottom: 20px; line-height: 20px;\">Ваш заказ номер <?=$arParams[\"ORDER_ID\"];?> от <?=$arParams[\"ORDER_DATE\"];?> принят.<br />\n<br />\nСтоимость заказа: <?=$arParams[\"PRICE\"];?>.<br />\n<br />\nСостав заказа:<br />\n<?=$arParams[\"ORDER_LIST\"];?><br />\n<br />\nВы можете следить за выполнением своего заказа (на какой стадии выполнения он находится), войдя в Ваш персональный раздел сайта <?=$arParams[\"SITE_NAME\"];?>.<br />\n<br />\nОбратите внимание, что для входа в этот раздел Вам необходимо будет ввести логин и пароль пользователя сайта <?=$arParams[\"SITE_NAME\"];?>.<br />\n<br />\nДля того, чтобы аннулировать заказ, воспользуйтесь функцией отмены заказа, которая доступна в Вашем персональном разделе сайта <?=$arParams[\"SITE_NAME\"];?>.<br />\n<br />\nПожалуйста, при обращении к администрации сайта <?=$arParams[\"SITE_NAME\"];?> ОБЯЗАТЕЛЬНО указывайте номер Вашего заказа - <?=$arParams[\"ORDER_ID\"];?>.<br />\n<br />\nСпасибо за покупку!<br />\n</p>\n		</td>\n	</tr>\n	<tr>\n		<td height=\"40px\" width=\"850\" bgcolor=\"#f7f7f7\" valign=\"top\" style=\"border: none; padding-top: 0; padding-right: 44px; padding-bottom: 30px; padding-left: 44px;\">\n			<p style=\"border-top: 1px solid #d1d1d1; margin-bottom: 5px; margin-top: 0; padding-top: 20px; line-height:21px;\">С уважением,<br />администрация <a href=\"http://<?=$arParams[\"SERVER_NAME\"];?>\" style=\"color:#2e6eb6;\">Интернет-магазина</a><br />\n				E-mail: <a href=\"mailto:<?=$arParams[\"SALE_EMAIL\"];?>\" style=\"color:#2e6eb6;\"><?=$arParams[\"SALE_EMAIL\"];?></a>\n			</p>\n		</td>\n	</tr>\n</table>\n</body>\n</html>', 'html', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
