(68, '2017-09-20 15:41:46', 'STATISTIC_ACTIVITY_EXCEEDING', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL_TO#', '#SERVER_NAME#: Превышен лимит активности', 'На сайте #SERVER_NAME# посетитель превысил установленный лимит активности.\n\nНачиная с #CURRENT_TIME# посетитель заблокирован на #DELAY_TIME# сек.\n\nАктивность  - #ACTIVITY_HITS# хитов за #ACTIVITY_TIME_LIMIT# сек. (лимит - #ACTIVITY_HITS_LIMIT#)\nПосетитель  - #VISITOR_ID#\nСессия      - #SESSION_ID#\nПоисковик   - [#SERACHER_ID#] #SEARCHER_NAME#\nUserAgent   - #USER_AGENT#\n\n>===============================================================================================\nДля добавления в стоп-лист воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##STOPLIST_LINK#\nДля просмотра сессии посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##SESSION_LINK#\nДля просмотра профайла посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##VISITOR_LINK#\nДля просмотра статистики хитов поисковика воспользуйтесь нижеследующей ссылкой:\nhttp://#SERVER_NAME##SEARCHER_LINK#\n', 'На сайте <?=$arParams[\"SERVER_NAME\"];?> посетитель превысил установленный лимит активности.\n\nНачиная с <?=$arParams[\"CURRENT_TIME\"];?> посетитель заблокирован на <?=$arParams[\"DELAY_TIME\"];?> сек.\n\nАктивность  - <?=$arParams[\"ACTIVITY_HITS\"];?> хитов за <?=$arParams[\"ACTIVITY_TIME_LIMIT\"];?> сек. (лимит - <?=$arParams[\"ACTIVITY_HITS_LIMIT\"];?>)\nПосетитель  - <?=$arParams[\"VISITOR_ID\"];?>\n\nСессия      - <?=$arParams[\"SESSION_ID\"];?>\n\nПоисковик   - [<?=$arParams[\"SERACHER_ID\"];?>] <?=$arParams[\"SEARCHER_NAME\"];?>\n\nUserAgent   - <?=$arParams[\"USER_AGENT\"];?>\n\n\n>===============================================================================================\nДля добавления в стоп-лист воспользуйтесь нижеследующей ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"STOPLIST_LINK\"];?>\n\nДля просмотра сессии посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"SESSION_LINK\"];?>\n\nДля просмотра профайла посетителя воспользуйтесь нижеследующей ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"VISITOR_LINK\"];?>\n\nДля просмотра статистики хитов поисковика воспользуйтесь нижеследующей ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"SEARCHER_LINK\"];?>\n\n', 'text', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(69, '2017-09-20 15:41:49', 'SUBSCRIBE_CONFIRM', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#EMAIL#', '#SITE_NAME#: Подтверждение подписки', 'Информационное сообщение сайта #SITE_NAME#\n------------------------------------------\n\nЗдравствуйте,\n\nВы получили это сообщение, так как ваш адрес был подписан\nна список рассылки сервера #SERVER_NAME#.\n\nДополнительная информация о подписке:\n\nАдрес подписки (email) ............ #EMAIL#\nДата добавления/редактирования .... #DATE_SUBSCR#\n\nВаш код для подтверждения подписки: #CONFIRM_CODE#\n\nДля подтверждения подписки перейдите по следующей ссылке:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#&CONFIRM_CODE=#CONFIRM_CODE#\n\nВы также можете ввести код для подтверждения подписки на странице:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#\n\nВнимание! Вы не будете получать сообщения рассылки, пока не подтвердите\nсвою подписку.\n\n---------------------------------------------------------------------\nСохраните это письмо, так как оно содержит информацию для авторизации.\nИспользуя код подтверждения подписки, вы cможете изменить параметры\nподписки или отписаться от рассылки.\n\nИзменить параметры:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#&CONFIRM_CODE=#CONFIRM_CODE#\n\nОтписаться:\nhttp://#SERVER_NAME##SUBSCR_SECTION#subscr_edit.php?ID=#ID#&CONFIRM_CODE=#CONFIRM_CODE#&action=unsubscribe\n---------------------------------------------------------------------\n\nСообщение сгенерировано автоматически.\n', 'Информационное сообщение сайта <?=$arParams[\"SITE_NAME\"];?>\n\n------------------------------------------\n\nЗдравствуйте,\n\nВы получили это сообщение, так как ваш адрес был подписан\nна список рассылки сервера <?=$arParams[\"SERVER_NAME\"];?>.\n\nДополнительная информация о подписке:\n\nАдрес подписки (email) ............ <?=$arParams[\"EMAIL\"];?>\n\nДата добавления/редактирования .... <?=$arParams[\"DATE_SUBSCR\"];?>\n\n\nВаш код для подтверждения подписки: <?=$arParams[\"CONFIRM_CODE\"];?>\n\n\nДля подтверждения подписки перейдите по следующей ссылке:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"SUBSCR_SECTION\"];?>subscr_edit.php?ID=<?=$arParams[\"ID\"];?>&CONFIRM_CODE=<?=$arParams[\"CONFIRM_CODE\"];?>\n\n\nВы также можете ввести код для подтверждения подписки на странице:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"SUBSCR_SECTION\"];?>subscr_edit.php?ID=<?=$arParams[\"ID\"];?>\n\n\nВнимание! Вы не будете получать сообщения рассылки, пока не подтвердите\nсвою подписку.\n\n---------------------------------------------------------------------\nСохраните это письмо, так как оно содержит информацию для авторизации.\nИспользуя код подтверждения подписки, вы cможете изменить параметры\nподписки или отписаться от рассылки.\n\nИзменить параметры:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"SUBSCR_SECTION\"];?>subscr_edit.php?ID=<?=$arParams[\"ID\"];?>&CONFIRM_CODE=<?=$arParams[\"CONFIRM_CODE\"];?>\n\n\nОтписаться:\nhttp://<?=$arParams[\"SERVER_NAME\"];?><?=$arParams[\"SUBSCR_SECTION\"];?>subscr_edit.php?ID=<?=$arParams[\"ID\"];?>&CONFIRM_CODE=<?=$arParams[\"CONFIRM_CODE\"];?>&action=unsubscribe\n---------------------------------------------------------------------\n\nСообщение сгенерировано автоматически.\n', 'text', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(70, '2017-09-20 15:41:51', 'TICKET_NEW_FOR_AUTHOR', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#OWNER_EMAIL#', '[TID##ID#] #SERVER_NAME#: Ваше обращение принято', 'Ваше обращение принято, ему присвоен номер #ID#.\n\nВы не должны отвечать на это письмо. Это только подтверждение, \nчто служба техподдержки получила ваше обращение и работает с ним.\n\nИнформация о вашем обращении:\n\nТема          - #TITLE# \nОт кого       - #SOURCE##OWNER_SID##OWNER_TEXT#\nКатегория     - #CATEGORY#\nКритичность   - #CRITICALITY#\n\nСоздано           - #CREATED_TEXT##CREATED_MODULE_NAME# [#DATE_CREATE#]\nОтветственный     - #RESPONSIBLE_TEXT#\nУровень поддержки - #SLA#\n\n>======================= СООБЩЕНИЕ ===================================\n\n#FILES_LINKS##MESSAGE_BODY#\n\n>=====================================================================\n\nДля просмотра и редактирования обращения воспользуйтесь ссылкой:\nhttp://#SERVER_NAME##PUBLIC_EDIT_URL#?ID=#ID#\n\nПисьмо сгенерировано автоматически.\n', 'Ваше обращение принято, ему присвоен номер <?=$arParams[\"ID\"];?>.\n\nВы не должны отвечать на это письмо. Это только подтверждение, \nчто служба техподдержки получила ваше обращение и работает с ним.\n\nИнформация о вашем обращении:\n\nТема          - <?=$arParams[\"TITLE\"];?> \nОт кого       - <?=$arParams[\"SOURCE\"];?><?=$arParams[\"OWNER_SID\"];?><?=$arParams[\"OWNER_TEXT\"];?>\n\nКатегория     - <?=$arParams[\"CATEGORY\"];?>\n\nКритичность   - <?=$arParams[\"CRITICALITY\"];?>\n\n\nСоздано           - <?=$arParams[\"CREATED_TEXT\"];?><?=$arParams[\"CREATED_MODULE_NAME\"];?> [<?=$arParams[\"DATE_CREATE\"];?>]\nОтветственный     - <?=$arParams[\"RESPONSIBLE_TEXT\"];?>\n\nУровень поддержки - <?=$arParams[\"SLA\"];?>\n\n\n>======================= СООБЩЕНИЕ ===================================\n\n<?=$arParams[\"FILES_LINKS\"];?><?=$arParams[\"MESSAGE_BODY\"];?>\n\n\n>=====================================================================\n\nДля просмотра и редактирования обращения воспользуйтесь 