(79, '2017-09-20 15:42:02', 'WF_IBLOCK_STATUS_CHANGE', 's1', 'Y', '#DEFAULT_EMAIL_FROM#', '#CREATED_BY_EMAIL#, #ADMIN_EMAIL#', '#SITE_NAME#: Изменен статус элемента # #ID# информационного блока # #IBLOCK_ID# (тип - #IBLOCK_TYPE#)', '#SITE_NAME#: Изменен статус элемента # #ID# информационного блока # #IBLOCK_ID# (тип - #IBLOCK_TYPE#)\n---------------------------------------------------------------------------\n\nСейчас поля элемента имеют следующие значения:\n\nНаименование - #NAME#\nСтатус       - [#STATUS_ID#] #STATUS_TITLE#; предыдущий - [#PREV_STATUS_ID#] #PREV_STATUS_TITLE#\nСоздан       - #DATE_CREATE#; [#CREATED_BY_ID#] #CREATED_BY_NAME#\nИзменен      - #DATE_MODIFY#; [#MODIFIED_BY_ID#] #MODIFIED_BY_NAME#\n\nАнонс (тип - #PREVIEW_TYPE#):\n---------------------------------------------------------------------------\n#PREVIEW_TEXT#\n---------------------------------------------------------------------------\n\nДетальное описание (тип - #DETAIL_TYPE#):\n---------------------------------------------------------------------------\n#DETAIL_TEXT#\n---------------------------------------------------------------------------\n\nКомментарий:\n---------------------------------------------------------------------------\n#COMMENTS#\n---------------------------------------------------------------------------\n\nДля просмотра и редактирования элемента воспользуйтесь ссылкой:\nhttp://#SERVER_NAME#/bitrix/admin/iblock_element_edit.php?lang=ru&WF=Y&PID=#ID#&type=#IBLOCK_TYPE#&IBLOCK_ID=#IBLOCK_ID#&filter_section=#SECTION_ID#\n\nПисьмо сгенерировано автоматически.\n', '<?=$arParams[\"SITE_NAME\"];?>: Изменен статус элемента # <?=$arParams[\"ID\"];?> информационного блока # <?=$arParams[\"IBLOCK_ID\"];?> (тип - <?=$arParams[\"IBLOCK_TYPE\"];?>)\n---------------------------------------------------------------------------\n\nСейчас поля элемента имеют следующие значения:\n\nНаименование - <?=$arParams[\"NAME\"];?>\n\nСтатус       - [<?=$arParams[\"STATUS_ID\"];?>] <?=$arParams[\"STATUS_TITLE\"];?>; предыдущий - [<?=$arParams[\"PREV_STATUS_ID\"];?>] <?=$arParams[\"PREV_STATUS_TITLE\"];?>\n\nСоздан       - <?=$arParams[\"DATE_CREATE\"];?>; [<?=$arParams[\"CREATED_BY_ID\"];?>] <?=$arParams[\"CREATED_BY_NAME\"];?>\n\nИзменен      - <?=$arParams[\"DATE_MODIFY\"];?>; [<?=$arParams[\"MODIFIED_BY_ID\"];?>] <?=$arParams[\"MODIFIED_BY_NAME\"];?>\n\n\nАнонс (тип - <?=$arParams[\"PREVIEW_TYPE\"];?>):\n---------------------------------------------------------------------------\n<?=$arParams[\"PREVIEW_TEXT\"];?>\n\n---------------------------------------------------------------------------\n\nДетальное описание (тип - <?=$arParams[\"DETAIL_TYPE\"];?>):\n---------------------------------------------------------------------------\n<?=$arParams[\"DETAIL_TEXT\"];?>\n\n---------------------------------------------------------------------------\n\nКомментарий:\n---------------------------------------------------------------------------\n<?=$arParams[\"COMMENTS\"];?>\n\n---------------------------------------------------------------------------\n\nДля просмотра и редактирования элемента воспользуйтесь ссылкой:\nhttp://<?=$arParams[\"SERVER_NAME\"];?>/bitrix/admin/iblock_element_edit.php?lang=ru&WF=Y&PID=<?=$arParams[\"ID\"];?>&type=<?=$arParams[\"IBLOCK_TYPE\"];?>&IBLOCK_ID=<?=$arParams[\"IBLOCK_ID\"];?>&filter_section=<?=$arParams[\"SECTION_ID\"];?>\n\n\nПисьмо сгенерировано автоматически.\n', 'text', '#BCC#', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
