(1, '2017-09-20 17:00:13', 1, '2017-09-20 17:00:13', 1, 1, NULL, 'Y', NULL, NULL, 500, 'Форум производителей одежды в России', 2, 'С 20 по 23 февраля состоится <strong>Форум производителей одежды в России</strong> &ndash; важнейшее мероприятии отрасли в этом году.', 'html', 3, '<p>С 20 по 23 февраля этого года состоится <strong>Форум производителей одежды в России</strong> &ndash; важнейшее мероприятии отрасли в текущем году. В экспозиции принимают участие свыше 160 компаний из <em>Беларуси, Австрии, Латвии, Литвы, России, Польши </em>и<em> Украины</em>. В составе форума состоится пять выставок:&quot;Московский Фэшн Салон&quot;, &quot;Технологии в Одежде&quot;, &quot;Офис Комфорт&quot;, &quot;Повседневная одежда&quot; и &quot;Детская одежда&quot;. Экспозиция будет строиться по принципу двух тематических секторов:<em> одежда</em> и <em>материалы для ее производства</em>.\r\n					<br />\r\n					</p>\r\n\r\n					<p>В секторе готовой одежды будут представлены:</p>\r\n\r\n					<ul>\r\n					<li>одежда для дома;</li>\r\n\r\n					<li>одежда для детей и молодежи;</li>\r\n\r\n					<li>аксессуары в одежде;</li>\r\n\r\n					<li>одежда для спорта и отдыха;</li>\r\n\r\n					<li>одежда для офиса.</li>\r\n					</ul>\r\n\r\n					<p>В секторе материалов для производства одежды будут демонстрироваться новинки рынка одежной фурнитуры, материалов, тканей, элементов и аксессуаров для производства одежды.\r\n					<br />\r\n					</p>\r\n\r\n					<p>Помимо расширенной экспозиции пяти тематических выставок &quot;Экспофорум&quot; подготовил разнообразную деловую программу форума производителей Одежды. В рамках выставки состоятся семинары и мастер-классы. И поистине масштабным в этом году обещает стать республиканский конкурс форума &quot;<strong>Народное признание</strong>&quot;. В этом году он выходит за рамки выставки и становится республиканским смотром образцов одежды.   </p>\r\n\r\n					<p><strong>Форум производителей Одежды</strong> предоставляет специалистам возможность познакомиться с тенденциями моды, провести переговоры, получить практические предложения рынка, увидеть перспективы развития и новые конкурентные преимущества. Впервые для участников конкурса будет подготовлен маркетинговый отчет по результатам опроса посетителей выставок <strong>Форума производителей Одежды</strong>.\r\n					<br />\r\n					</p>\r\n\r\n					<p><em>Прием заявок на участие в конкурсе осуществляется до 12 января этого года.</em></p>\r\n\r\n					<ul> </ul>\r\n ', 'html', 'ФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ\r\nС 20 ПО 23 ФЕВРАЛЯ СОСТОИТСЯ ФОРУМ ПРОИЗВОДИТЕЛЕЙ \r\nОДЕЖДЫ В РОССИИ &NDASH; ВАЖНЕЙШЕЕ МЕРОПРИЯТИИ \r\nОТРАСЛИ В ЭТОМ ГОДУ.\r\nС 20 ПО 23 ФЕВРАЛЯ ЭТОГО ГОДА СОСТОИТСЯ ФОРУМ \r\nПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ В РОССИИ &NDASH; ВАЖНЕЙШЕЕ \r\nМЕРОПРИЯТИИ ОТРАСЛИ В ТЕКУЩЕМ ГОДУ. В ЭКСПОЗИЦИИ \r\nПРИНИМАЮТ УЧАСТИЕ СВЫШЕ 160 КОМПАНИЙ ИЗ БЕЛАРУСИ, \r\nАВСТРИИ, ЛАТВИИ, ЛИТВЫ, РОССИИ, ПОЛЬШИ И \r\nУКРАИНЫ. В СОСТАВЕ ФОРУМА СОСТОИТСЯ ПЯТЬ \r\nВЫСТАВОК:\"МОСКОВСКИЙ ФЭШН САЛОН\", \"ТЕХНОЛОГИИ \r\nВ ОДЕЖДЕ\", \"ОФИС КОМФОРТ\", \"ПОВСЕДНЕВНАЯ ОДЕЖДА\" \r\nИ \"ДЕТСКАЯ ОДЕЖДА\". ЭКСПОЗИЦИЯ БУДЕТ СТРОИТЬСЯ \r\nПО ПРИНЦИПУ ДВУХ ТЕМАТИЧЕСКИХ СЕКТОРОВ: ОДЕЖДА \r\nИ МАТЕРИАЛЫ ДЛЯ ЕЕ ПРОИЗВОДСТВА. \r\n \r\n\r\nВ СЕКТОРЕ ГОТОВОЙ ОДЕЖДЫ БУДУТ ПРЕДСТАВЛЕНЫ: \r\n\r\n- ОДЕЖДА ДЛЯ ДОМА; \r\n- ОДЕЖДА ДЛЯ ДЕТЕЙ И МОЛОДЕЖИ; \r\n- АКСЕССУАРЫ В ОДЕЖДЕ; \r\n- ОДЕЖДА ДЛЯ СПОРТА И ОТДЫХА; \r\n- ОДЕЖДА ДЛЯ ОФИСА. \r\n\r\nВ СЕКТОРЕ МАТЕРИАЛОВ ДЛЯ ПРОИЗВОДСТВА \r\nОДЕЖДЫ БУДУТ ДЕМОНСТРИРОВАТЬСЯ НОВИНКИ \r\nРЫНКА ОДЕЖНОЙ ФУРНИТУРЫ, МАТЕРИАЛОВ, ТКАНЕЙ, \r\nЭЛЕМЕНТОВ И АКСЕССУАРОВ ДЛЯ ПРОИЗВОДСТВА \r\nОДЕЖДЫ. \r\n \r\n\r\nПОМИМО РАСШИРЕННОЙ ЭКСПОЗИЦИИ ПЯТИ ТЕМАТИЧЕСКИХ \r\nВЫСТАВОК \"ЭКСПОФОРУМ\" ПОДГОТОВИЛ РАЗНООБРАЗНУЮ \r\nДЕЛОВУЮ ПРОГРАММУ ФОРУМА ПРОИЗВОДИТЕЛЕЙ \r\nОДЕЖДЫ. В РАМКАХ ВЫСТАВКИ СОСТОЯТСЯ СЕМИНАРЫ \r\nИ МАСТЕР-КЛАССЫ. И ПОИСТИНЕ МАСШТАБНЫМ В \r\nЭТОМ ГОДУ ОБЕЩАЕТ СТАТЬ РЕСПУБЛИКАНСКИЙ \r\nКОНКУРС ФОРУМА \"НАРОДНОЕ ПРИЗНАНИЕ\". В ЭТОМ \r\nГОДУ ОН ВЫХОДИТ ЗА РАМКИ ВЫСТАВКИ И СТАНОВИТСЯ \r\nРЕСПУБЛИКАНСКИМ СМОТРОМ ОБРАЗЦОВ ОДЕЖДЫ. \r\n   \r\n\r\nФОРУМ ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ ПРЕДОСТАВЛЯЕТ \r\nСПЕЦИАЛИСТАМ ВОЗМОЖНОСТЬ ПОЗНАКОМИТЬСЯ \r\nС ТЕНДЕНЦИЯМИ МОДЫ, ПРОВЕСТИ ПЕРЕГОВОРЫ, \r\nПОЛУЧИТЬ ПРАКТИЧЕСКИЕ ПРЕДЛОЖЕНИЯ РЫНКА, \r\nУВИДЕТЬ ПЕРСПЕКТИВЫ РАЗВИТИЯ И НОВЫЕ КОНКУРЕНТНЫЕ \r\nПРЕИМУЩЕСТВА. ВПЕРВЫЕ ДЛЯ УЧАСТНИКОВ КОНКУРСА \r\nБУДЕТ ПОДГОТОВЛЕН МАРКЕТИНГОВЫЙ ОТЧЕТ \r\nПО РЕЗУЛЬТАТАМ ОПРОСА ПОСЕТИТЕЛЕЙ ВЫСТАВОК \r\nФОРУМА ПРОИЗВОДИТЕЛЕЙ ОДЕЖДЫ. \r\n \r\n\r\nПРИЕМ ЗАЯВОК НА УЧАСТИЕ В КОНКУРСЕ ОСУЩЕСТВЛЯЕТСЯ \r\nДО 12 ЯНВАРЯ ЭТОГО ГОДА.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '1', 'forum_of_producers_of_clothes_in_russia', '', '-600328566', NULL, NULL, NULL),
(2, '2017-09-20 17:00:13', 1, '2017-09-20 17:00:13', 1, 1, NULL, 'Y', NULL, NULL, 500, 'Международная выставка одежды Salon De Fashion', 4, 'В следующем году состоится выставка одежды - Salon De Fashion, которая обещает быть еще более расширенной и интересной.', 'html', NULL, 'В следующем  году выставка Salon De Fashion обещает быть еще более расширенной и интересной. На выставке Salon De Fashion будут представлены все типы одежды для офиса и дома от платьев и шорт до VIP-аксессуаров, включая оборудование для производства и детской одежды. \r\n					<div>\r\n					<br />\r\n					</div>\r\n\r\n					<div>Заявки на участие подали более чем 1 500 компаний со всего мира. Предполагается, что за время проведения выставки ее посетят более 300 000 тысяч человек. Экспозиция выставки разместится на общей площади 149 871 кв.м. В следующем году эта поистине грандиозная выставка будет проводиться уже в 14-й раз.</div>\r\n				', 'html', 'МЕЖДУНАРОДНАЯ ВЫСТАВКА ОДЕЖДЫ SALON DE FASHION\r\nВ СЛЕДУЮЩЕМ ГОДУ СОСТОИТСЯ ВЫСТАВКА ОДЕЖДЫ \r\n- SALON DE FASHION, КОТОРАЯ ОБЕЩАЕТ БЫТЬ ЕЩЕ БОЛЕЕ \r\nРАСШИРЕННОЙ И ИНТЕРЕСНОЙ.\r\nВ СЛЕДУЮЩЕМ  ГОДУ ВЫСТАВКА SALON DE FASHION ОБЕЩАЕТ \r\nБЫТЬ ЕЩЕ БОЛЕЕ РАСШИРЕННОЙ И ИНТЕРЕСНОЙ. \r\nНА ВЫСТАВКЕ SALON DE FASHION БУДУТ ПРЕДСТАВЛЕНЫ \r\nВСЕ ТИПЫ ОДЕЖДЫ ДЛЯ ОФИСА И ДОМА ОТ ПЛАТЬЕВ \r\nИ ШОРТ ДО VIP-АКСЕССУАРОВ, ВКЛЮЧАЯ ОБОРУДОВАНИЕ \r\nДЛЯ ПРОИЗВОДСТВА И ДЕТСКОЙ ОДЕЖДЫ.  \r\nЗАЯВКИ НА УЧАСТИЕ ПОДАЛИ БОЛЕЕ ЧЕМ 1 500 КОМПАНИЙ \r\nСО ВСЕГО МИРА. ПРЕДПОЛАГАЕТСЯ, ЧТО ЗА ВРЕМЯ \r\nПРОВЕДЕНИЯ ВЫСТАВКИ ЕЕ ПОСЕТЯТ БОЛЕЕ 300 \r\n000 ТЫСЯЧ ЧЕЛОВЕК. ЭКСПОЗИЦИЯ ВЫСТАВКИ РАЗМЕСТИТСЯ \r\nНА ОБЩЕЙ ПЛОЩАДИ 149 871 КВ.М. В СЛЕДУЮЩЕМ ГОДУ \r\nЭТА ПОИСТИНЕ ГРАНДИОЗНАЯ ВЫСТАВКА БУДЕТ \r\nПРОВОДИТЬСЯ УЖЕ В 14-Й РАЗ.', 1, NULL, NULL, NULL, NULL, NULL, 'N', '8', 'exhibition_salon_de_fashion', '', '1890358504', NULL, NULL, NULL),
(3, '2017-09-20 17:00:13', 1, '2017-09-20 17:00:13', 1, 1, NULL, 'Y', NULL, NULL, 500, 'Новое веяние в одежде - получено прочное водостойкое соединение', 8, 'Получено новое прочное водостойкое клеевое соединение.Изобретение относится к области получения и применения клеящих составов, используемых в обработке тканей, кожи и других материалов. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный очень гибкий отвердитель. Который даст возможность делать новые виды аппликаций и соединения тканей и различных типов материалов.', 'html', 9, '<b>Авторы изобретения</b>: Разиньков Егор Михайлович и Зайцева Анна Анатольевна\r\n					<br />\r\n					Патент Российской Федерации RU2277566\r\n					<br />\r\n\r\n					<h3>Описание изобретения</h3>\r\n\r\n					<p>Изобретение относится к области получения и применения клеящих составов, используемых в производстве одежды и аксессуаров. Данная клеевая композиция предназначена только для горячего прессования и имеет в своем составе многокомпонентный гибкий отвердитель. Прототипом клеевой композиции является клей, состоящий из карбамидоформальдегидной смолы, сополимера акрилонитрила с N-винилкапролактамом и отвердитель. В качестве отвердителя применяют хлористый аммоний либо акриловую кислоту. </p>\r\n\r\n					<p>Изобретение решает задачу по получению прочного и водостойкого клеевого соединения. Это достигается тем, что клеевая композиция, включающая синтетическую смолу и отвердитель, согласно изобретению, дополнительно содержит модификатор, причем в качестве синтетической смолы клеевая композиция включает карбамидомеламиноформальдегидную смолу с отвердителем 2542, в качестве модификатора - карбамидоформальдегидную смолу, а в качестве отвердителя - 10%-ный раствор щавелевой кислоты при следующем соотношении компонентов, мас.ч.: </p>\r\n\r\n					<table cellspacing=\"0\">\r\n					<tbody>\r\n					<tr> <td>Карбамидомеламиноформальдегидная смола</td><td>64,5-79,2</td> </tr>\r\n\r\n					<tr> <td>10%-ный Раствор щавелевой кислоты</td><td>4,4-20,5</td> </tr>\r\n\r\n					<tr> <td> Отвердитель для карбамидомеламиноформальдегидной </td><td>0,6-2,0</td> </tr>\r\n\r\n					<tr> <td> смолы 2542</td><td>13,0-15,8</td> </tr>\r\n					</tbody>\r\n					</table>\r\n', 'html', 'НОВОЕ ВЕЯНИЕ В ОДЕЖДЕ - ПОЛУЧЕНО ПРОЧНОЕ ВОДОСТОЙКОЕ СОЕДИНЕНИЕ\r\nПОЛУЧЕНО НОВОЕ ПРОЧНОЕ ВОДОСТОЙКОЕ КЛЕЕВОЕ \r\nСОЕДИНЕНИЕ.ИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ \r\nПОЛУЧЕНИЯ И ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, \r\nИСПОЛЬЗУЕМЫХ В ОБРАБОТКЕ ТКАНЕЙ, КОЖИ И \r\nДРУГИХ МАТЕРИАЛОВ. ДАННАЯ КЛЕЕВАЯ КОМПОЗИЦИЯ \r\nПРЕДНАЗНАЧЕНА ТОЛЬКО ДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ \r\nИ ИМЕЕТ В СВОЕМ СОСТАВЕ МНОГОКОМПОНЕНТНЫЙ \r\nОЧЕНЬ ГИБКИЙ ОТВЕРДИТЕЛЬ. КОТОРЫЙ ДАСТ \r\nВОЗМОЖНОСТЬ ДЕЛАТЬ НОВЫЕ ВИДЫ АППЛИКАЦИЙ \r\nИ СОЕДИНЕНИЯ ТКАНЕЙ И РАЗЛИЧНЫХ ТИПОВ МАТЕРИАЛОВ.\r\nАВТОРЫ ИЗОБРЕТЕНИЯ: РАЗИНЬКОВ ЕГОР МИХАЙЛОВИЧ \r\nИ ЗАЙЦЕВА АННА АНАТОЛЬЕВНА \r\nПАТЕНТ РОССИЙСКОЙ ФЕДЕРАЦИИ RU2277566 \r\nОПИСАНИЕ ИЗОБРЕТЕНИЯ \r\n\r\nИЗОБРЕТЕНИЕ ОТНОСИТСЯ К ОБЛАСТИ ПОЛУЧЕНИЯ \r\nИ ПРИМЕНЕНИЯ КЛЕЯЩИХ СОСТАВОВ, ИСПОЛЬЗУЕМЫХ \r\nВ ПРОИЗВОДСТВЕ ОДЕЖДЫ И АКСЕССУАРОВ. ДАННАЯ \r\nКЛЕЕВАЯ КОМПОЗИЦИЯ ПРЕДНАЗНАЧЕНА ТОЛЬКО \r\nДЛЯ ГОРЯЧЕГО ПРЕССОВАНИЯ И ИМЕЕТ В СВОЕМ \r\nСОСТАВЕ МНОГОКОМПОНЕНТНЫЙ ГИБКИЙ ОТВЕРДИТЕЛЬ. \r\nПРОТОТИПОМ КЛЕЕВОЙ КОМПОЗИЦИИ ЯВЛЯЕТСЯ \r\nКЛЕЙ, СОСТОЯЩИЙ ИЗ КАРБАМИДОФОРМАЛЬДЕГИДНОЙ \r\nСМОЛЫ, СОПОЛИМЕРА АКРИЛОНИТРИЛА С N-ВИНИЛКАПРОЛАКТАМОМ \r\nИ ОТВЕРДИТЕЛЬ. В КАЧЕСТВЕ ОТВЕРДИТЕЛЯ ПРИМЕНЯЮТ \r\nХЛОРИСТЫЙ АММОНИЙ ЛИБО АКРИЛОВУЮ КИСЛОТУ. \r\n\r\nИЗОБРЕТЕНИЕ РЕШАЕТ ЗАДАЧУ ПО ПОЛУЧЕНИЮ \r\nПРОЧНОГО И ВОДОСТОЙКОГО КЛЕЕВОГО СОЕДИНЕНИЯ. \r\nЭТО ДОСТИГАЕТСЯ ТЕМ, ЧТО КЛЕЕВАЯ КОМПОЗИЦИЯ, \r\nВКЛЮЧАЮЩАЯ СИНТЕТИЧЕСКУЮ СМОЛУ И ОТВЕРДИТЕЛЬ, \r\nСОГЛАСНО ИЗОБРЕТЕНИЮ, ДОПОЛНИТЕЛЬНО СОДЕРЖИТ \r\nМОДИФИКАТОР, ПРИЧЕМ В КАЧЕСТВЕ СИНТЕТИЧЕСКОЙ \r\nСМОЛЫ КЛЕЕВАЯ КОМПОЗИЦИЯ ВКЛЮЧАЕТ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНУЮ \r\nСМОЛУ С ОТВЕРДИТЕЛЕМ 2542, В КАЧЕСТВЕ МОДИФИКАТОРА \r\n- КАРБАМИДОФОРМАЛЬДЕГИДНУЮ СМОЛУ, А В КАЧЕСТВЕ \r\nОТВЕРДИТЕЛЯ - 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ \r\nПРИ СЛЕДУЮЩЕМ СООТНОШЕНИИ КОМПОНЕНТОВ, \r\nМАС.Ч.: \r\n КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНАЯ СМОЛА \r\n   64,5-79,2     \r\n 10%-НЫЙ РАСТВОР ЩАВЕЛЕВОЙ КИСЛОТЫ    4,4-20,5 \r\n    \r\n ОТВЕРДИТЕЛЬ ДЛЯ КАРБАМИДОМЕЛАМИНОФОРМАЛЬДЕГИДНОЙ \r\n    0,6-2,0     \r\n СМОЛЫ 2542    13,0-15,8', 1, NULL, NULL, NULL, NULL, NULL, 'N', '9', 'waterproof_connection', '', '-2110133196', NULL, NULL, NULL),
(4, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 8, 'Y', NULL, NULL, 810, 'Штаны Полосатый Рейс', NULL, '', 'text', 50, 'Брюки-клеш идеально сидят и подчеркивают стройность фигуры. Модель имеет застежку на молнию. Изделие будет прекрасно гармонировать с любыми предметами гардероба. Длина изделия ок. 100см. Длина по внутреннему шву ок. 83см. Ширина внизу ок. 87см.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Форма брючин:</b> Широкие брючины</li>\n\n							<li><b>Вид застежки: </b>Молния</li>\n\n							<li><b>По назначению: </b>Повседневные</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль: </b>Женственный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ШТАНЫ ПОЛОСАТЫЙ РЕЙС\r\n\r\nБРЮКИ-КЛЕШ ИДЕАЛЬНО СИДЯТ И ПОДЧЕРКИВАЮТ \r\nСТРОЙНОСТЬ ФИГУРЫ. МОДЕЛЬ ИМЕЕТ ЗАСТЕЖКУ \r\nНА МОЛНИЮ. ИЗДЕЛИЕ БУДЕТ ПРЕКРАСНО ГАРМОНИРОВАТЬ \r\nС ЛЮБЫМИ ПРЕДМЕТАМИ ГАРДЕРОБА. ДЛИНА ИЗДЕЛИЯ \r\nОК. 100СМ. ДЛИНА ПО ВНУТРЕННЕМУ ШВУ ОК. 83СМ. \r\nШИРИНА ВНИЗУ ОК. 87СМ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ФОРМА БРЮЧИН: ШИРОКИЕ БРЮЧИНЫ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ЖЕНСТВЕННЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '177', 'pants-striped-flight', '', '1538583368', NULL, NULL, NULL),
(5, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 8, 'Y', NULL, NULL, 380, 'Штаны Жизнь в Абстракции', NULL, '', 'text', 51, 'Свободные штаны с эффектом свободы, создают дополнительный разогревающий эффект во время ходьбы. Штаны &ndash; незаменимая вещь для репетиций и занятий танцами, прекрасно сочетаются с любым купальником или майкой. Вся одежда отечественной компании Grishko производится в России!\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки:</b> Завязки</li>\n\n							<li><b>По назначению:</b> Спорт</li>\n\n							<li><b>Габариты предметов:</b> Длина, 58.0 см</li>\n\n							<li><b>Брюки: </b>Ширина брючин, 28.0 см</li>\n\n							<li><b>Брюки: </b>Высота посадки, 30.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 29.0 см</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда: </b>Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ШТАНЫ ЖИЗНЬ В АБСТРАКЦИИ\r\n\r\nСВОБОДНЫЕ ШТАНЫ С ЭФФЕКТОМ СВОБОДЫ, СОЗДАЮТ \r\nДОПОЛНИТЕЛЬНЫЙ РАЗОГРЕВАЮЩИЙ ЭФФЕКТ ВО \r\nВРЕМЯ ХОДЬБЫ. ШТАНЫ &NDASH; НЕЗАМЕНИМАЯ ВЕЩЬ \r\nДЛЯ РЕПЕТИЦИЙ И ЗАНЯТИЙ ТАНЦАМИ, ПРЕКРАСНО \r\nСОЧЕТАЮТСЯ С ЛЮБЫМ КУПАЛЬНИКОМ ИЛИ МАЙКОЙ. \r\nВСЯ ОДЕЖДА ОТЕЧЕСТВЕННОЙ КОМПАНИИ GRISHKO \r\nПРОИЗВОДИТСЯ В РОССИИ! \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВИД ЗАСТЕЖКИ: ЗАВЯЗКИ \r\n- ПО НАЗНАЧЕНИЮ: СПОРТ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 58.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 28.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 30.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 29.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '207', 'pants-life-in-abstraction', '', '-276303257', NULL, NULL, NULL),
(6, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 8, 'Y', NULL, NULL, 100, 'Штаны Цветочная Поляна', NULL, 'Прекрасные штаны, длинные, выполненные из цветного материала. Свободный крой дарит комфорт и уверенность движений. Отличный вариант для женского гардероба.', 'text', 52, 'Великолепные брюки фасона широкий клеш помогут создать стильный костюм. Модель удобно застегиваются на молнию сбоку. Такие брюки позволят обратить на Вас внимание окружающих и придать Вашему виду экстравагантность.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Форма брючин:</b> Широкий клеш</li>\n\n							<li><b>Вид застежки:</b><span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span>Молния</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Габариты предметов:</b> Длина, 103.5 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 48.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 24.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 82.0 см</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль:</b> Деловой стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ШТАНЫ ЦВЕТОЧНАЯ ПОЛЯНА\r\nПРЕКРАСНЫЕ ШТАНЫ, ДЛИННЫЕ, ВЫПОЛНЕННЫЕ ИЗ ЦВЕТНОГО МАТЕРИАЛА. СВОБОДНЫЙ КРОЙ ДАРИТ КОМФОРТ И УВЕРЕННОСТЬ ДВИЖЕНИЙ. ОТЛИЧНЫЙ ВАРИАНТ ДЛЯ ЖЕНСКОГО ГАРДЕРОБА.\r\nВЕЛИКОЛЕПНЫЕ БРЮКИ ФАСОНА ШИРОКИЙ КЛЕШ \r\nПОМОГУТ СОЗДАТЬ СТИЛЬНЫЙ КОСТЮМ. МОДЕЛЬ \r\nУДОБНО ЗАСТЕГИВАЮТСЯ НА МОЛНИЮ СБОКУ. ТАКИЕ \r\nБРЮКИ ПОЗВОЛЯТ ОБРАТИТЬ НА ВАС ВНИМАНИЕ \r\nОКРУЖАЮЩИХ И ПРИДАТЬ ВАШЕМУ ВИДУ ЭКСТРАВАГАНТНОСТЬ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ФОРМА БРЮЧИН: ШИРОКИЙ КЛЕШ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 103.5 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 48.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 24.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 82.0 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ДЕЛОВОЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '223', 'pants-flower-glade', '', '-653230249', NULL, NULL, NULL),
(7, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 7, 'Y', NULL, NULL, 690, 'Платье Модница на Прогулке', NULL, '', 'text', 53, 'Великолепное и стильное платье поможет создать незабываемый образ. Оригинальный покрой и длина выгодно подчеркнут все достоинства Вашей фигуры. Отличный вариант для любого случая.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина изделия:</b> Миди, 92.0 см</li>\n\n							<li><b>Длина рукава:</b> Короткие, 12.0 см</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль:</b> Casual</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ПЛАТЬЕ МОДНИЦА НА ПРОГУЛКЕ\r\n\r\nВЕЛИКОЛЕПНОЕ И СТИЛЬНОЕ ПЛАТЬЕ ПОМОЖЕТ \r\nСОЗДАТЬ НЕЗАБЫВАЕМЫЙ ОБРАЗ. ОРИГИНАЛЬНЫЙ \r\nПОКРОЙ И ДЛИНА ВЫГОДНО ПОДЧЕРКНУТ ВСЕ ДОСТОИНСТВА \r\nВАШЕЙ ФИГУРЫ. ОТЛИЧНЫЙ ВАРИАНТ ДЛЯ ЛЮБОГО \r\nСЛУЧАЯ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА ИЗДЕЛИЯ: МИДИ, 92.0 СМ \r\n- ДЛИНА РУКАВА: КОРОТКИЕ, 12.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: CASUAL \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '253', 'dress-fashionista-on-a-walk', '', '-1269643534', NULL, NULL, NULL),
(8, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 7, 'Y', NULL, NULL, 750, 'Платье Весенняя Легкость', NULL, '', 'text', 59, 'Трикотажное платье без рукавов и округлым вырезом горловины. Небольшие складки по линии талии и широкий втачной пояс формируют привлекательный силуэт. Отличный выбор для ярких будней.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вырез горловины:</b> Округлый вырез</li>\n\n							<li><b>Длина изделия:</b> Миди, 92.0 см</li>\n\n							<li><b>Длина рукава: </b>Длинные, 57.0 см</li>\n\n							<li><b>Покрой:</b> Приталенный</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль:</b> Женственный стиль</li>\n\n							<li><b>Страна бренда: </b>Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ПЛАТЬЕ ВЕСЕННЯЯ ЛЕГКОСТЬ\r\n\r\nТРИКОТАЖНОЕ ПЛАТЬЕ БЕЗ РУКАВОВ И ОКРУГЛЫМ \r\nВЫРЕЗОМ ГОРЛОВИНЫ. НЕБОЛЬШИЕ СКЛАДКИ ПО \r\nЛИНИИ ТАЛИИ И ШИРОКИЙ ВТАЧНОЙ ПОЯС ФОРМИРУЮТ \r\nПРИВЛЕКАТЕЛЬНЫЙ СИЛУЭТ. ОТЛИЧНЫЙ ВЫБОР \r\nДЛЯ ЯРКИХ БУДНЕЙ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫРЕЗ ГОРЛОВИНЫ: ОКРУГЛЫЙ ВЫРЕЗ \r\n- ДЛИНА ИЗДЕЛИЯ: МИДИ, 92.0 СМ \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 57.0 СМ \r\n- ПОКРОЙ: ПРИТАЛЕННЫЙ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ЖЕНСТВЕННЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '262', 'dress-spring-ease', '', '-743738834', NULL, NULL, NULL),
(9, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 7, 'Y', NULL, NULL, 740, 'Платье Ночная Жизнь', NULL, 'Элегантное платье из приятного вискозного материала с добавлением искусственных волокон подчеркнет тонкий вкус и мастерство в подборе нарядов своей обладательницы. ', 'text', 65, 'Превосходное платье, выполненное из комфортного материала. Модель эффектно открывает плечи. Приталенный силуэт подчеркивает стройность фигуры. Отличный вариант для женского гардероба.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина изделия:</b> Мини, 85.0 см</li>\n\n							<li><b>Длина рукава: </b>Длинные, 56.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Женственный стиль</li>\n\n							<li><b>Страна бренда:</b> Турция</li>\n\n							<li><b>Страна производитель:</b> Турция</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ПЛАТЬЕ НОЧНАЯ ЖИЗНЬ\r\nЭЛЕГАНТНОЕ ПЛАТЬЕ ИЗ ПРИЯТНОГО ВИСКОЗНОГО МАТЕРИАЛА С ДОБАВЛЕНИЕМ ИСКУССТВЕННЫХ ВОЛОКОН ПОДЧЕРКНЕТ ТОНКИЙ ВКУС И МАСТЕРСТВО В ПОДБОРЕ НАРЯДОВ СВОЕЙ ОБЛАДАТЕЛЬНИЦЫ. \r\nПРЕВОСХОДНОЕ ПЛАТЬЕ, ВЫПОЛНЕННОЕ ИЗ КОМФОРТНОГО \r\nМАТЕРИАЛА. МОДЕЛЬ ЭФФЕКТНО ОТКРЫВАЕТ ПЛЕЧИ. \r\nПРИТАЛЕННЫЙ СИЛУЭТ ПОДЧЕРКИВАЕТ СТРОЙНОСТЬ \r\nФИГУРЫ. ОТЛИЧНЫЙ ВАРИАНТ ДЛЯ ЖЕНСКОГО ГАРДЕРОБА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА ИЗДЕЛИЯ: МИНИ, 85.0 СМ \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 56.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ЖЕНСТВЕННЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: ТУРЦИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: ТУРЦИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '271', 'dress-nightlife', '', '-1395494052', NULL, NULL, NULL),
(10, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 7, 'Y', NULL, NULL, 710, 'Платье Красная Фея', NULL, '', 'text', 71, 'Превосходное платье, выполненное из комфортного материала. Модель эффектно открывает плечи. Приталенный силуэт подчеркивает стройность фигуры. Отличный вариант для женского гардероба.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина изделия:</b> Мини, 85.0 см</li>\n\n							<li><b>Длина рукава: </b>Длинные, 56.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль: </b>Женственный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель: </b>Турция</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ПЛАТЬЕ КРАСНАЯ ФЕЯ\r\n\r\nПРЕВОСХОДНОЕ ПЛАТЬЕ, ВЫПОЛНЕННОЕ ИЗ КОМФОРТНОГО \r\nМАТЕРИАЛА. МОДЕЛЬ ЭФФЕКТНО ОТКРЫВАЕТ ПЛЕЧИ. \r\nПРИТАЛЕННЫЙ СИЛУЭТ ПОДЧЕРКИВАЕТ СТРОЙНОСТЬ \r\nФИГУРЫ. ОТЛИЧНЫЙ ВАРИАНТ ДЛЯ ЖЕНСКОГО ГАРДЕРОБА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА ИЗДЕЛИЯ: МИНИ, 85.0 СМ \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 56.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: ЖЕНСТВЕННЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: ТУРЦИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '280', 'dress-red-fairy', '', '502000353', NULL, NULL, NULL),
(11, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 9, 'Y', NULL, NULL, 450, 'Нижнее белье Морская Волна', NULL, '', 'text', 78, 'Замечательные трусики-стринги. Цельновязанная поясная резинка нежно поддерживает живот до родов и мягко облегает его в течение восстановительного периода. Открытая модель идеально подходит тем, кто отдает предпочтение юбкам и брюкам с заниженной талией. Модели производятся на новейшем современном оборудовании. Для изготовления используются только самые лучшие экологически чистые полотна.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Габариты предметов:</b> Высота посадки, 21.0 см</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Страна бренда:</b> Турция</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'НИЖНЕЕ БЕЛЬЕ МОРСКАЯ ВОЛНА\r\n\r\nЗАМЕЧАТЕЛЬНЫЕ ТРУСИКИ-СТРИНГИ. ЦЕЛЬНОВЯЗАННАЯ \r\nПОЯСНАЯ РЕЗИНКА НЕЖНО ПОДДЕРЖИВАЕТ ЖИВОТ \r\nДО РОДОВ И МЯГКО ОБЛЕГАЕТ ЕГО В ТЕЧЕНИЕ \r\nВОССТАНОВИТЕЛЬНОГО ПЕРИОДА. ОТКРЫТАЯ МОДЕЛЬ \r\nИДЕАЛЬНО ПОДХОДИТ ТЕМ, КТО ОТДАЕТ ПРЕДПОЧТЕНИЕ \r\nЮБКАМ И БРЮКАМ С ЗАНИЖЕННОЙ ТАЛИЕЙ. МОДЕЛИ \r\nПРОИЗВОДЯТСЯ НА НОВЕЙШЕМ СОВРЕМЕННОМ ОБОРУДОВАНИИ. \r\nДЛЯ ИЗГОТОВЛЕНИЯ ИСПОЛЬЗУЮТСЯ ТОЛЬКО САМЫЕ \r\nЛУЧШИЕ ЭКОЛОГИЧЕСКИ ЧИСТЫЕ ПОЛОТНА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ВЫСОТА ПОСАДКИ, 21.0 \r\nСМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: ТУРЦИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '289', 'underwear-sea-wave', '', '204275831', NULL, NULL, NULL),
(12, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 9, 'Y', NULL, NULL, 700, 'Нижнее белье Белая Свобода', NULL, 'Крупнейший производитель женского белья. Белье становиться второй кожей благодаря нежным тканям, создающим настроение ностальгии. Комфорт при ношении обеспечивают высокофункциональные материалы.', 'text', 85, 'Привлекательные трусики-слипы из трикотажного эластичного полотна и кружева. Эта модель смотрится изумительно, подчеркивая Ваше изящество и пристрастие ко всему красивому. Ластовица выполнена из хлопка, благодаря чему не раздражает нежную и чувствительную кожу. В комплекте 2 штуки удобных трусиков.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Декоративные элементы: </b>Кружево</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Габариты предметов:</b> Высота посадки, 11.0 см</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия<span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span></li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'НИЖНЕЕ БЕЛЬЕ БЕЛАЯ СВОБОДА\r\nКРУПНЕЙШИЙ ПРОИЗВОДИТЕЛЬ ЖЕНСКОГО БЕЛЬЯ. БЕЛЬЕ СТАНОВИТЬСЯ ВТОРОЙ КОЖЕЙ БЛАГОДАРЯ НЕЖНЫМ ТКАНЯМ, СОЗДАЮЩИМ НАСТРОЕНИЕ НОСТАЛЬГИИ. КОМФОРТ ПРИ НОШЕНИИ ОБЕСПЕЧИВАЮТ ВЫСОКОФУНКЦИОНАЛЬНЫЕ МАТЕРИАЛЫ.\r\nПРИВЛЕКАТЕЛЬНЫЕ ТРУСИКИ-СЛИПЫ ИЗ ТРИКОТАЖНОГО \r\nЭЛАСТИЧНОГО ПОЛОТНА И КРУЖЕВА. ЭТА МОДЕЛЬ \r\nСМОТРИТСЯ ИЗУМИТЕЛЬНО, ПОДЧЕРКИВАЯ ВАШЕ \r\nИЗЯЩЕСТВО И ПРИСТРАСТИЕ КО ВСЕМУ КРАСИВОМУ. \r\nЛАСТОВИЦА ВЫПОЛНЕНА ИЗ ХЛОПКА, БЛАГОДАРЯ \r\nЧЕМУ НЕ РАЗДРАЖАЕТ НЕЖНУЮ И ЧУВСТВИТЕЛЬНУЮ \r\nКОЖУ. В КОМПЛЕКТЕ 2 ШТУКИ УДОБНЫХ ТРУСИКОВ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЕКОРАТИВНЫЕ ЭЛЕМЕНТЫ: КРУЖЕВО \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ВЫСОТА ПОСАДКИ, 11.0 \r\nСМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '298', 'underwear-white-freedom', '', '-1440793870', NULL, NULL, NULL),
(13, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 9, 'Y', NULL, NULL, 430, 'Нижнее белье Интимный Вечер', NULL, '', 'text', 91, 'Великолепные трусики, оформленные полупрозрачными вставками, станут Вашими верными спутниками на каждый день. Ведь они такие удобные - будут сидеть как влитые, не доставляя ни капли дискомфорта.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Габариты предметов:</b> Высота посадки, 22.5 см</li>\n\n							<li><b>Сезон: </b>круглогодичный</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Страна бренда:</b> Франция</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'НИЖНЕЕ БЕЛЬЕ ИНТИМНЫЙ ВЕЧЕР\r\n\r\nВЕЛИКОЛЕПНЫЕ ТРУСИКИ, ОФОРМЛЕННЫЕ ПОЛУПРОЗРАЧНЫМИ \r\nВСТАВКАМИ, СТАНУТ ВАШИМИ ВЕРНЫМИ СПУТНИКАМИ \r\nНА КАЖДЫЙ ДЕНЬ. ВЕДЬ ОНИ ТАКИЕ УДОБНЫЕ - \r\nБУДУТ СИДЕТЬ КАК ВЛИТЫЕ, НЕ ДОСТАВЛЯЯ НИ \r\nКАПЛИ ДИСКОМФОРТА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ВЫСОТА ПОСАДКИ, 22.5 \r\nСМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: ФРАНЦИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '307', 'lingerie-intimate-evening', '', '1304439428', NULL, NULL, NULL),
