(16, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:18', 1, 2, 9, 'Y', NULL, NULL, 800, 'Нижнее белье Розовое Смущенье', NULL, '', 'text', 105, 'Потрясающий бюстгальтер, выполненный из нежного полупрозрачного кружева. Модель на тонких съемных бретелях регулируемой длины. Чувственное глубокое декольте украшено изумительными сатиновыми лентами. Сзади &ndash; застежка на крючки. Чашечки изделия с косточками. Пушапа нет.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Фактура материала: </b>Кружевные</li>\n\n							<li><b>Декоративные элементы:</b> Банты</li>\n\n							<li><b>Вид бретелек: </b>Тонкие бретельки</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль: </b>Сексуальный стиль</li>\n\n							<li><b>Страна бренда:</b> Соединенные Штаты</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'НИЖНЕЕ БЕЛЬЕ РОЗОВОЕ СМУЩЕНЬЕ\r\n\r\nПОТРЯСАЮЩИЙ БЮСТГАЛЬТЕР, ВЫПОЛНЕННЫЙ ИЗ \r\nНЕЖНОГО ПОЛУПРОЗРАЧНОГО КРУЖЕВА. МОДЕЛЬ \r\nНА ТОНКИХ СЪЕМНЫХ БРЕТЕЛЯХ РЕГУЛИРУЕМОЙ \r\nДЛИНЫ. ЧУВСТВЕННОЕ ГЛУБОКОЕ ДЕКОЛЬТЕ УКРАШЕНО \r\nИЗУМИТЕЛЬНЫМИ САТИНОВЫМИ ЛЕНТАМИ. СЗАДИ \r\n&NDASH; ЗАСТЕЖКА НА КРЮЧКИ. ЧАШЕЧКИ ИЗДЕЛИЯ \r\nС КОСТОЧКАМИ. ПУШАПА НЕТ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ФАКТУРА МАТЕРИАЛА: КРУЖЕВНЫЕ \r\n- ДЕКОРАТИВНЫЕ ЭЛЕМЕНТЫ: БАНТЫ \r\n- ВИД БРЕТЕЛЕК: ТОНКИЕ БРЕТЕЛЬКИ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СЕКСУАЛЬНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: СОЕДИНЕННЫЕ ШТАТЫ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '341', 'underwear-rose-perplexity', '', '-1251939750', NULL, NULL, NULL),
