(18, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 10, 'Y', NULL, NULL, 790, 'Футболка Мужская Чистота', NULL, '', 'text', 117, 'Стильная футболка с V-образным вырезом горловины и короткими рукавами станет отличным дополнением к любому мужскому гардеробу. Модель выполнена из натурального хлопкового материала, приятного на ощупь.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина рукава: </b>Длинные, 19.0 см</li>\n\n							<li><b>Габариты предметов:</b> Длина, 68.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Мужской</li>\n\n							<li><b>Стиль:</b> Городской стиль</li>\n\n							<li><b>Страна бренда:</b> Бельгия</li>\n\n							<li><b>Страна производитель:</b> Бангладеш</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ФУТБОЛКА МУЖСКАЯ ЧИСТОТА\r\n\r\nСТИЛЬНАЯ ФУТБОЛКА С V-ОБРАЗНЫМ ВЫРЕЗОМ \r\nГОРЛОВИНЫ И КОРОТКИМИ РУКАВАМИ СТАНЕТ ОТЛИЧНЫМ \r\nДОПОЛНЕНИЕМ К ЛЮБОМУ МУЖСКОМУ ГАРДЕРОБУ. \r\nМОДЕЛЬ ВЫПОЛНЕНА ИЗ НАТУРАЛЬНОГО ХЛОПКОВОГО \r\nМАТЕРИАЛА, ПРИЯТНОГО НА ОЩУПЬ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 19.0 СМ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 68.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: МУЖСКОЙ \r\n- СТИЛЬ: ГОРОДСКОЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: БЕЛЬГИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: БАНГЛАДЕШ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '359', 't-shirt-mens-purity', '', '-517175482', NULL, NULL, NULL),
