(21, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 10, 'Y', NULL, NULL, 770, 'Футболка Мужской Огонь', NULL, 'Отличная футболка с короткими рукавами и округлым вырезом горловины. Изделие комфортного покроя выполнено из натурального материала. Прекрасный вариант для занятий спортом.', 'text', 131, 'Приятная футболка с округлым вырезом горловины и короткими втачными рукавами. Спереди оформлена декоративными строчками.\n							<div>\n							<br />\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вырез горловины:</b> Округлый вырез</li>\n\n							<li><b>Длина рукава: </b>Короткие, 21.00 см</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Габариты предметов:</b> Длина, 68.00 см</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол:</b> Мужской</li>\n\n							<li><b>Стиль:</b> Casual</li>\n\n							<li><b>Страна бренда:</b> Израиль</li>\n\n							<li><b>Страна производитель: </b>Россия</li>\n							</ul>\n							</div>\n							</div>\n							</div>\n						', 'html', 'ФУТБОЛКА МУЖСКОЙ ОГОНЬ\r\nОТЛИЧНАЯ ФУТБОЛКА С КОРОТКИМИ РУКАВАМИ И ОКРУГЛЫМ ВЫРЕЗОМ ГОРЛОВИНЫ. ИЗДЕЛИЕ КОМФОРТНОГО ПОКРОЯ ВЫПОЛНЕНО ИЗ НАТУРАЛЬНОГО МАТЕРИАЛА. ПРЕКРАСНЫЙ ВАРИАНТ ДЛЯ ЗАНЯТИЙ СПОРТОМ.\r\nПРИЯТНАЯ ФУТБОЛКА С ОКРУГЛЫМ ВЫРЕЗОМ ГОРЛОВИНЫ \r\nИ КОРОТКИМИ ВТАЧНЫМИ РУКАВАМИ. СПЕРЕДИ \r\nОФОРМЛЕНА ДЕКОРАТИВНЫМИ СТРОЧКАМИ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫРЕЗ ГОРЛОВИНЫ: ОКРУГЛЫЙ ВЫРЕЗ \r\n- ДЛИНА РУКАВА: КОРОТКИЕ, 21.00 СМ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 68.00 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: МУЖСКОЙ \r\n- СТИЛЬ: CASUAL \r\n- СТРАНА БРЕНДА: ИЗРАИЛЬ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '386', 't-shirt-men-s-fire', '', '797846124', NULL, NULL, NULL),
(22, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 10, 'Y', NULL, NULL, 340, 'Футболка Женский Соблазн', NULL, '', 'text', 137, 'Отличная футболка, выполненная из натурального хлопкового материала. Модель с короткими рукавами и округлым вырезом горловины. Изделие украшает оригинальный принт.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина рукава:</b> Короткие, 6.0 см</li>\n\n							<li><b>Габариты предметов:</b> Длина, 58.0 см</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Casual</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ФУТБОЛКА ЖЕНСКИЙ СОБЛАЗН\r\n\r\nОТЛИЧНАЯ ФУТБОЛКА, ВЫПОЛНЕННАЯ ИЗ НАТУРАЛЬНОГО \r\nХЛОПКОВОГО МАТЕРИАЛА. МОДЕЛЬ С КОРОТКИМИ \r\nРУКАВАМИ И ОКРУГЛЫМ ВЫРЕЗОМ ГОРЛОВИНЫ. \r\nИЗДЕЛИЕ УКРАШАЕТ ОРИГИНАЛЬНЫЙ ПРИНТ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА РУКАВА: КОРОТКИЕ, 6.0 СМ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 58.0 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: CASUAL \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '395', 't-shirt-female-temptation', '', '-963575469', NULL, NULL, NULL),
(23, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 11, 'Y', NULL, NULL, 420, 'Спортивный Костюм Нежная Теплота', NULL, '', 'text', 143, 'Замечательный спортивный костюм, состоящий из куртки и брюк. Манжеты, талия, низ изделия и капюшон регулируются в 2 направлениях одной рукой. Капюшон сворачивается и убирается в ворот под молнию. Изделия легко складываются в маленькую сумочку, которая идет в комплекте к костюму.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки: </b>Липучка</li>\n\n							<li><b>Длина рукава: </b>Длинные, 79.0 см</li>\n\n							<li><b>Вид застежки: </b>Молния</li>\n\n							<li><b>Тип карманов:</b> Втачные</li>\n\n							<li><b>Габариты предметов: </b>Длина, 75.0 см</li>\n\n							<li><b>Брюки: </b>Ширина брючин, 34.0 см</li>\n\n							<li><b>Брюки: </b>Высота посадки, 28.0 см</li>\n\n							<li><b>Брюки: </b>Длина по внутреннему шву, 78.0 см</li>\n\n							<li><b>Сезон: </b>демисезон</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Стиль: </b>Спортивный стиль</li>\n\n							<li><b>Страна бренда: </b>Швеция</li>\n\n							<li><b>Страна производитель: </b>Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'СПОРТИВНЫЙ КОСТЮМ НЕЖНАЯ ТЕПЛОТА\r\n\r\nЗАМЕЧАТЕЛЬНЫЙ СПОРТИВНЫЙ КОСТЮМ, СОСТОЯЩИЙ \r\nИЗ КУРТКИ И БРЮК. МАНЖЕТЫ, ТАЛИЯ, НИЗ ИЗДЕЛИЯ \r\nИ КАПЮШОН РЕГУЛИРУЮТСЯ В 2 НАПРАВЛЕНИЯХ \r\nОДНОЙ РУКОЙ. КАПЮШОН СВОРАЧИВАЕТСЯ И УБИРАЕТСЯ \r\nВ ВОРОТ ПОД МОЛНИЮ. ИЗДЕЛИЯ ЛЕГКО СКЛАДЫВАЮТСЯ \r\nВ МАЛЕНЬКУЮ СУМОЧКУ, КОТОРАЯ ИДЕТ В КОМПЛЕКТЕ \r\nК КОСТЮМУ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВИД ЗАСТЕЖКИ: ЛИПУЧКА \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 79.0 СМ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ТИП КАРМАНОВ: ВТАЧНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 75.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 34.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 28.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 78.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: ШВЕЦИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '404', 'sports-suit-gentle-warmth', '', '-1213959797', NULL, NULL, NULL),
(24, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 11, 'Y', NULL, NULL, 400, 'Спортивный Костюм Огонь в Ночи', NULL, '', 'text', 149, 'Превосходный спортивный костюм, состоящий из толстовки и брюк. Толстовка имеет застежку на молнию и воротник &quot;стойка&quot;. Низ изделия эластичный. Толстовка оформлена декоративными вставками яркого контрастного цвета. Спортивные брюки прямого покроя имеют удобный эластичный пояс и прорезные карманы.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки:</b> Шнурки</li>\n\n							<li><b>Длина рукава:</b> Длинные, 62.0 см</li>\n\n							<li><b>Вид застежки:</b> Молния</li>\n\n							<li><b>Тип карманов:</b> Прорезные</li>\n\n							<li><b>Габариты предметов:</b> Длина, 55.0 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 22.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 21.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 83.0 см</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n\n							<div>\n							<br />\n							</div>\n							</div>\n							</div>\n						', 'html', 'СПОРТИВНЫЙ КОСТЮМ ОГОНЬ В НОЧИ\r\n\r\nПРЕВОСХОДНЫЙ СПОРТИВНЫЙ КОСТЮМ, СОСТОЯЩИЙ \r\nИЗ ТОЛСТОВКИ И БРЮК. ТОЛСТОВКА ИМЕЕТ ЗАСТЕЖКУ \r\nНА МОЛНИЮ И ВОРОТНИК \"СТОЙКА\". НИЗ ИЗДЕЛИЯ \r\nЭЛАСТИЧНЫЙ. ТОЛСТОВКА ОФОРМЛЕНА ДЕКОРАТИВНЫМИ \r\nВСТАВКАМИ ЯРКОГО КОНТРАСТНОГО ЦВЕТА. СПОРТИВНЫЕ \r\nБРЮКИ ПРЯМОГО ПОКРОЯ ИМЕЮТ УДОБНЫЙ ЭЛАСТИЧНЫЙ \r\nПОЯС И ПРОРЕЗНЫЕ КАРМАНЫ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВИД ЗАСТЕЖКИ: ШНУРКИ \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 62.0 СМ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ТИП КАРМАНОВ: ПРОРЕЗНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 55.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 22.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 21.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 83.0 СМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '413', 'sports-suit-fire-in-the-night', '', '1246731920', NULL, NULL, NULL),
(25, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 11, 'Y', NULL, NULL, 500, 'Спортивный Костюм Элегантность в Ночи', NULL, '', 'text', 155, 'Замечательный спортивный костюм, состоящий из толстовки и брюк. Толстовка с длинными рукавами застегивается на молнию и дополнена удобными карманами. Брюки на эластичном поясе. Длина брюк ок. 101 см.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина рукава:</b> Длинные, 74.0 см</li>\n\n							<li><b>Вид застежки:</b> Молния</li>\n\n							<li><b>Габариты предметов:</b> Длина, 65.0 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 23.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 24.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 80.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Страна бренда:</b> Германия</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'СПОРТИВНЫЙ КОСТЮМ ЭЛЕГАНТНОСТЬ В НОЧИ\r\n\r\nЗАМЕЧАТЕЛЬНЫЙ СПОРТИВНЫЙ КОСТЮМ, СОСТОЯЩИЙ \r\nИЗ ТОЛСТОВКИ И БРЮК. ТОЛСТОВКА С ДЛИННЫМИ \r\nРУКАВАМИ ЗАСТЕГИВАЕТСЯ НА МОЛНИЮ И ДОПОЛНЕНА \r\nУДОБНЫМИ КАРМАНАМИ. БРЮКИ НА ЭЛАСТИЧНОМ \r\nПОЯСЕ. ДЛИНА БРЮК ОК. 101 СМ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 74.0 СМ \r\n- ВИД ЗАСТЕЖКИ: МОЛНИЯ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 65.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 23.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 24.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 80.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: ГЕРМАНИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '422', 'sports-suit-elegance-in-the-night', '', '412582730', NULL, NULL, NULL),
(26, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 11, 'Y', NULL, NULL, 730, 'Спортивный Костюм Розовый Вихрь', NULL, '', 'text', 161, 'Великолепный спортивный костюм состоящий из свитшота и брюк. Свитшот с длинными рукавами и капюшоном на спинке декорирован принтом с нанесением шелкографии. Брюки прямого кроя выполнены на поясе на эластичной резинке, низ оформлен трикотажными манжетами. Прекрасный вариант как для занятий спортом, так и для повседневной носки.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки:</b> Завязки</li>\n\n							<li><b>Длина рукава:</b> Длинные, 63.0 см</li>\n\n							<li><b>Тип карманов:</b> Втачные</li>\n\n							<li><b>Габариты предметов:</b> Длина, 64.0 см</li>\n\n							<li><b>Брюки:</b> Высота посадки, 27.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 80.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'СПОРТИВНЫЙ КОСТЮМ РОЗОВЫЙ ВИХРЬ\r\n\r\nВЕЛИКОЛЕПНЫЙ СПОРТИВНЫЙ КОСТЮМ СОСТОЯЩИЙ \r\nИЗ СВИТШОТА И БРЮК. СВИТШОТ С ДЛИННЫМИ РУКАВАМИ \r\nИ КАПЮШОНОМ НА СПИНКЕ ДЕКОРИРОВАН ПРИНТОМ \r\nС НАНЕСЕНИЕМ ШЕЛКОГРАФИИ. БРЮКИ ПРЯМОГО \r\nКРОЯ ВЫПОЛНЕНЫ НА ПОЯСЕ НА ЭЛАСТИЧНОЙ РЕЗИНКЕ, \r\nНИЗ ОФОРМЛЕН ТРИКОТАЖНЫМИ МАНЖЕТАМИ. ПРЕКРАСНЫЙ \r\nВАРИАНТ КАК ДЛЯ ЗАНЯТИЙ СПОРТОМ, ТАК И ДЛЯ \r\nПОВСЕДНЕВНОЙ НОСКИ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВИД ЗАСТЕЖКИ: ЗАВЯЗКИ \r\n- ДЛИНА РУКАВА: ДЛИННЫЕ, 63.0 СМ \r\n- ТИП КАРМАНОВ: ВТАЧНЫЕ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 64.0 СМ \r\n- БРЮКИ: ВЫСОТА ПОСАДКИ, 27.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 80.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '438', 'sports-suit-pink-vortex', '', '-1373094861', NULL, NULL, NULL),
(27, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 11, 'Y', NULL, NULL, 500, 'Спортивный Костюм Дыхание Спорта', NULL, '', 'text', 167, 'Очаровательный комбинезон с тонкой бретель-американка. Облегающий силуэт. Эффектная модель, которая поможет подчеркнуть достоинства Вашей фигуры. Практичный вариант для занятий спортом.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вырез горловины:</b> V-образный вырез</li>\n\n							<li><b>Длина изделия:</b> Мини, 90.0 см</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Длина рукава:</b> Без рукавов</li>\n\n							<li><b>Вид бретелек:</b> Тонкие бретельки</li>\n\n							<li><b>Габариты предметов:</b><span class=\"Apple-tab-span\" style=\"white-space: pre;\">	</span> Длина, 94.0 см</li>\n\n							<li><b>Брюки:</b> Ширина брючин, 30.0 см</li>\n\n							<li><b>Брюки:</b> Длина по внутреннему шву, 13.0 см</li>\n\n							<li><b>Сезон</b>: лето</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'СПОРТИВНЫЙ КОСТЮМ ДЫХАНИЕ СПОРТА\r\n\r\nОЧАРОВАТЕЛЬНЫЙ КОМБИНЕЗОН С ТОНКОЙ БРЕТЕЛЬ-АМЕРИКАНКА. \r\nОБЛЕГАЮЩИЙ СИЛУЭТ. ЭФФЕКТНАЯ МОДЕЛЬ, КОТОРАЯ \r\nПОМОЖЕТ ПОДЧЕРКНУТЬ ДОСТОИНСТВА ВАШЕЙ \r\nФИГУРЫ. ПРАКТИЧНЫЙ ВАРИАНТ ДЛЯ ЗАНЯТИЙ \r\nСПОРТОМ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫРЕЗ ГОРЛОВИНЫ: V-ОБРАЗНЫЙ ВЫРЕЗ \r\n- ДЛИНА ИЗДЕЛИЯ: МИНИ, 90.0 СМ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- ДЛИНА РУКАВА: БЕЗ РУКАВОВ \r\n- ВИД БРЕТЕЛЕК: ТОНКИЕ БРЕТЕЛЬКИ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 94.0 СМ \r\n- БРЮКИ: ШИРИНА БРЮЧИН, 30.0 СМ \r\n- БРЮКИ: ДЛИНА ПО ВНУТРЕННЕМУ ШВУ, 13.0 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '447', 'sports-suit-breath-sports', '', '249000599', NULL, NULL, NULL),
(28, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:19', 1, 2, 11, 'Y', NULL, NULL, 720, 'Спортивный Костюм Вечерний Спорт', NULL, 'Прекрасный комплект, состоящий из футболки с округлым вырезом горловины и короткими рукавами и шорт. Модель выполнена из качественного материала. Отличный вариант на каждый день.', 'text', 173, 'Платье из коллекции Марии Шараповой, российской теннисистки, 2-ой ракетки мира, заслуженного мастера спорта. Особенности включают в себя Dri-FIT - легкая и дышащая ткань, обеспечивающая спортсменам сухость и комфорт. Конструкция плоских швов сводит натирание к нулю, предотвращая появление раздражения. Сетчатые вставки на теплостойкой поверхности улучшают вентиляцию. Вшитое бра со вставками из сетчатой ткани обеспечивает эффективную поддержку и вентиляцию. Swoosh логотип дополняет.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Длина изделия: </b>Мини, 80.0 см</li>\n\n							<li><b>По назначению:</b> Спорт</li>\n\n							<li><b>Длина рукава:</b> Без рукавов</li>\n\n							<li><b>Вид бретелек:</b> Тонкие бретельки</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Стиль:</b> Спортивный стиль</li>\n\n							<li><b>Страна бренда:</b> Соединенные Штаты</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'СПОРТИВНЫЙ КОСТЮМ ВЕЧЕРНИЙ СПОРТ\r\nПРЕКРАСНЫЙ КОМПЛЕКТ, СОСТОЯЩИЙ ИЗ ФУТБОЛКИ С ОКРУГЛЫМ ВЫРЕЗОМ ГОРЛОВИНЫ И КОРОТКИМИ РУКАВАМИ И ШОРТ. МОДЕЛЬ ВЫПОЛНЕНА ИЗ КАЧЕСТВЕННОГО МАТЕРИАЛА. ОТЛИЧНЫЙ ВАРИАНТ НА КАЖДЫЙ ДЕНЬ.\r\nПЛАТЬЕ ИЗ КОЛЛЕКЦИИ МАРИИ ШАРАПОВОЙ, РОССИЙСКОЙ \r\nТЕННИСИСТКИ, 2-ОЙ РАКЕТКИ МИРА, ЗАСЛУЖЕННОГО \r\nМАСТЕРА СПОРТА. ОСОБЕННОСТИ ВКЛЮЧАЮТ В \r\nСЕБЯ DRI-FIT - ЛЕГКАЯ И ДЫШАЩАЯ ТКАНЬ, ОБЕСПЕЧИВАЮЩАЯ \r\nСПОРТСМЕНАМ СУХОСТЬ И КОМФОРТ. КОНСТРУКЦИЯ \r\nПЛОСКИХ ШВОВ СВОДИТ НАТИРАНИЕ К НУЛЮ, ПРЕДОТВРАЩАЯ \r\nПОЯВЛЕНИЕ РАЗДРАЖЕНИЯ. СЕТЧАТЫЕ ВСТАВКИ \r\nНА ТЕПЛОСТОЙКОЙ ПОВЕРХНОСТИ УЛУЧШАЮТ ВЕНТИЛЯЦИЮ. \r\nВШИТОЕ БРА СО ВСТАВКАМИ ИЗ СЕТЧАТОЙ ТКАНИ \r\nОБЕСПЕЧИВАЕТ ЭФФЕКТИВНУЮ ПОДДЕРЖКУ И ВЕНТИЛЯЦИЮ. \r\nSWOOSH ЛОГОТИП ДОПОЛНЯЕТ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ДЛИНА ИЗДЕЛИЯ: МИНИ, 80.0 СМ \r\n- ПО НАЗНАЧЕНИЮ: СПОРТ \r\n- ДЛИНА РУКАВА: БЕЗ РУКАВОВ \r\n- ВИД БРЕТЕЛЕК: ТОНКИЕ БРЕТЕЛЬКИ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТИЛЬ: СПОРТИВНЫЙ СТИЛЬ \r\n- СТРАНА БРЕНДА: СОЕДИНЕННЫЕ ШТАТЫ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '456', 'sports-suit-evening-activities', '', '-2104192906', NULL, NULL, NULL),
(29, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 3, 'Y', NULL, NULL, 500, 'Домашние Тапочки Розовый Рай', NULL, '', 'text', 180, '							<div>Симпатичные тапочки, украшенные вышивкой в виде мышки. Модель оформлена рисунком в полоску. Комфортная и уютная обувь для домашнего отдыха.</div>\n\n							<div>\n							<br />\n							</div>\n\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Высота каблука:</b> Без каблука</li>\n\n							<li><b>Высота платформы:</b> Низкая, 0.5 см</li>\n\n							<li><b>Материал верха:</b> Текстиль</li>\n\n							<li><b>Материал подошвы:</b> Резина</li>\n\n							<li><b>Материал подкладки:</b> Кожа</li>\n\n							<li><b>Сезон:</b> Круглогодичный</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Страна бренда: </b>Россия</li>\n\n							<li><b>Страна производитель: </b>Китай</li>\n							</ul>\n							</div>\n						', 'html', 'ДОМАШНИЕ ТАПОЧКИ РОЗОВЫЙ РАЙ\r\n\r\nСИМПАТИЧНЫЕ ТАПОЧКИ, УКРАШЕННЫЕ ВЫШИВКОЙ \r\nВ ВИДЕ МЫШКИ. МОДЕЛЬ ОФОРМЛЕНА РИСУНКОМ \r\nВ ПОЛОСКУ. КОМФОРТНАЯ И УЮТНАЯ ОБУВЬ ДЛЯ \r\nДОМАШНЕГО ОТДЫХА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫСОТА КАБЛУКА: БЕЗ КАБЛУКА \r\n- ВЫСОТА ПЛАТФОРМЫ: НИЗКАЯ, 0.5 СМ \r\n- МАТЕРИАЛ ВЕРХА: ТЕКСТИЛЬ \r\n- МАТЕРИАЛ ПОДОШВЫ: РЕЗИНА \r\n- МАТЕРИАЛ ПОДКЛАДКИ: КОЖА \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '465', 'slippers-pink-paradise', '', '808917914', NULL, NULL, NULL),
(30, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 3, 'Y', NULL, NULL, 500, 'Домашние Тапочки Любимый Спорт', NULL, '', 'text', 186, 'Замечательные тапочки согреют и обеспечат комфорт при носке. Изделие с закругленным мыском декорировано отстрочкой и нашивкой с изображением фирменного логотипа. Практичный вариант на каждый день.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Высота каблука:</b> Без каблука</li>\n\n							<li><b>Высота платформы:</b> Низкая, 1.5 см</li>\n\n							<li><b>Материал верха:</b> Текстиль</li>\n\n							<li><b>Материал подкладки:</b> Текстиль</li>\n\n							<li><b>Материал подошвы:</b> Полимер</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол: </b>Мужской</li>\n\n							<li><b>Страна бренда: </b>Россия</li>\n\n							<li><b>Страна производитель:</b> Россия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ДОМАШНИЕ ТАПОЧКИ ЛЮБИМЫЙ СПОРТ\r\n\r\nЗАМЕЧАТЕЛЬНЫЕ ТАПОЧКИ СОГРЕЮТ И ОБЕСПЕЧАТ \r\nКОМФОРТ ПРИ НОСКЕ. ИЗДЕЛИЕ С ЗАКРУГЛЕННЫМ \r\nМЫСКОМ ДЕКОРИРОВАНО ОТСТРОЧКОЙ И НАШИВКОЙ \r\nС ИЗОБРАЖЕНИЕМ ФИРМЕННОГО ЛОГОТИПА. ПРАКТИЧНЫЙ \r\nВАРИАНТ НА КАЖДЫЙ ДЕНЬ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫСОТА КАБЛУКА: БЕЗ КАБЛУКА \r\n- ВЫСОТА ПЛАТФОРМЫ: НИЗКАЯ, 1.5 СМ \r\n- МАТЕРИАЛ ВЕРХА: ТЕКСТИЛЬ \r\n- МАТЕРИАЛ ПОДКЛАДКИ: ТЕКСТИЛЬ \r\n- МАТЕРИАЛ ПОДОШВЫ: ПОЛИМЕР \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: МУЖСКОЙ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РОССИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '475', 'slippers-favorite-sport', '', '1524217363', NULL, NULL, NULL),
(31, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 6, 'Y', NULL, NULL, 500, 'Туфли Летняя Легкость', NULL, '', 'text', 192, 'Туфли лаконичного исполнения, классической расцветки - идеальный вариант для современного мужчины. Мысок закругленной формы. Спереди - застежка. Материал подкладки - натуральная кожа.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Вид застежки:</b> Шнурки</li>\n\n							<li><b>Высота каблука:</b> Средний, 3.0 см</li>\n\n							<li><b>Высота платформы:</b> Низкая, 1.2 см</li>\n\n							<li><b>Материал верха:</b> Кожа</li>\n\n							<li><b>Материал подкладки:</b> Кожа</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Мужской</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель: </b>Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ТУФЛИ ЛЕТНЯЯ ЛЕГКОСТЬ\r\n\r\nТУФЛИ ЛАКОНИЧНОГО ИСПОЛНЕНИЯ, КЛАССИЧЕСКОЙ \r\nРАСЦВЕТКИ - ИДЕАЛЬНЫЙ ВАРИАНТ ДЛЯ СОВРЕМЕННОГО \r\nМУЖЧИНЫ. МЫСОК ЗАКРУГЛЕННОЙ ФОРМЫ. СПЕРЕДИ \r\n- ЗАСТЕЖКА. МАТЕРИАЛ ПОДКЛАДКИ - НАТУРАЛЬНАЯ \r\nКОЖА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВИД ЗАСТЕЖКИ: ШНУРКИ \r\n- ВЫСОТА КАБЛУКА: СРЕДНИЙ, 3.0 СМ \r\n- ВЫСОТА ПЛАТФОРМЫ: НИЗКАЯ, 1.2 СМ \r\n- МАТЕРИАЛ ВЕРХА: КОЖА \r\n- МАТЕРИАЛ ПОДКЛАДКИ: КОЖА \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: МУЖСКОЙ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '484', 'shoes-summer-lightness', '', '1996490580', NULL, NULL, NULL),
(32, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 5, 'Y', NULL, NULL, 470, 'Туфли Вечерняя Бабочка', NULL, '', 'text', 198, '							<div>Эффектные туфли на высоком каблуке помогут Вам создать яркий запоминающийся образ. Подкладка изготовлена из натуральной кожи, подошва выполнена из тунита. Модель оформлена декоративными ремешками и прострочкой.</div>\n\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Высота каблука:</b> Высокий, 11.3 см</li>\n\n							<li><b>Высота платформы:</b> Низкая, 1.6 см</li>\n\n							<li><b>По назначению:</b> Повседневные</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Страна бренда:</b> Китай</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ТУФЛИ ВЕЧЕРНЯЯ БАБОЧКА\r\n\r\nЭФФЕКТНЫЕ ТУФЛИ НА ВЫСОКОМ КАБЛУКЕ ПОМОГУТ \r\nВАМ СОЗДАТЬ ЯРКИЙ ЗАПОМИНАЮЩИЙСЯ ОБРАЗ. \r\nПОДКЛАДКА ИЗГОТОВЛЕНА ИЗ НАТУРАЛЬНОЙ КОЖИ, \r\nПОДОШВА ВЫПОЛНЕНА ИЗ ТУНИТА. МОДЕЛЬ ОФОРМЛЕНА \r\nДЕКОРАТИВНЫМИ РЕМЕШКАМИ И ПРОСТРОЧКОЙ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫСОТА КАБЛУКА: ВЫСОКИЙ, 11.3 СМ \r\n- ВЫСОТА ПЛАТФОРМЫ: НИЗКАЯ, 1.6 СМ \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: КИТАЙ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '493', 'shoes-evening-butterfly', '', '487737754', NULL, NULL, NULL),
(33, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 2, 'Y', NULL, NULL, 500, 'Пантолеты Кости на Пляже', NULL, '', 'text', 204, 'Эти оригинальные пантолеты - идеальный вариант для пляжного отдыха. Модель выполнена из высококачественного каучука. Модель на гибкой подошве оформлена фирменным логотипом.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Высота каблука</b>: Без каблука</li>\n\n							<li><b>Высота платформы: </b>Низкая, 1.5 см</li>\n\n							<li><b>Сезон: </b>лето</li>\n\n							<li><b>Пол: </b>Мужской</li>\n\n							<li><b>Страна бренда: </b>Франция</li>\n\n							<li><b>Страна производитель: </b>Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ПАНТОЛЕТЫ КОСТИ НА ПЛЯЖЕ\r\n\r\nЭТИ ОРИГИНАЛЬНЫЕ ПАНТОЛЕТЫ - ИДЕАЛЬНЫЙ \r\nВАРИАНТ ДЛЯ ПЛЯЖНОГО ОТДЫХА. МОДЕЛЬ ВЫПОЛНЕНА \r\nИЗ ВЫСОКОКАЧЕСТВЕННОГО КАУЧУКА. МОДЕЛЬ \r\nНА ГИБКОЙ ПОДОШВЕ ОФОРМЛЕНА ФИРМЕННЫМ ЛОГОТИПОМ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫСОТА КАБЛУКА: БЕЗ КАБЛУКА \r\n- ВЫСОТА ПЛАТФОРМЫ: НИЗКАЯ, 1.5 СМ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: МУЖСКОЙ \r\n- СТРАНА БРЕНДА: ФРАНЦИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '502', 'pantolety-bones-on-the-beach', '', '-1925949943', NULL, NULL, NULL),
(34, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 5, 'Y', NULL, NULL, 500, 'Туфли Полет Валькирии', NULL, '', 'text', 210, 'Превосходные туфли с открытым мыском. Высокий каблук компенсирован широким передом. Модель выполнена из натуральной кожи с лаковым покрытием. Прекрасный вариант для создания женственного образа.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Высота каблука:</b> Высокий, 14.0 см</li>\n\n							<li><b>Высота платформы:</b> Низкая, 4.5 см</li>\n\n							<li><b>Материал верха:</b> Кожа</li>\n\n							<li><b>Материал подошвы:</b> Искусственный материал</li>\n\n							<li><b>Материал подкладки:</b> Кожа</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол: </b>Женский</li>\n\n							<li><b>Страна бренда: </b>Китай</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ТУФЛИ ПОЛЕТ ВАЛЬКИРИИ\r\n\r\nПРЕВОСХОДНЫЕ ТУФЛИ С ОТКРЫТЫМ МЫСКОМ. ВЫСОКИЙ \r\nКАБЛУК КОМПЕНСИРОВАН ШИРОКИМ ПЕРЕДОМ. МОДЕЛЬ \r\nВЫПОЛНЕНА ИЗ НАТУРАЛЬНОЙ КОЖИ С ЛАКОВЫМ \r\nПОКРЫТИЕМ. ПРЕКРАСНЫЙ ВАРИАНТ ДЛЯ СОЗДАНИЯ \r\nЖЕНСТВЕННОГО ОБРАЗА. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫСОТА КАБЛУКА: ВЫСОКИЙ, 14.0 СМ \r\n- ВЫСОТА ПЛАТФОРМЫ: НИЗКАЯ, 4.5 СМ \r\n- МАТЕРИАЛ ВЕРХА: КОЖА \r\n- МАТЕРИАЛ ПОДОШВЫ: ИСКУССТВЕННЫЙ МАТЕРИАЛ \r\n- МАТЕРИАЛ ПОДКЛАДКИ: КОЖА \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: КИТАЙ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '511', 'shoes-flight-of-the-valkyries', '', '-1805845150', NULL, NULL, NULL),
(35, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 5, 'Y', NULL, NULL, 330, 'Туфли Ультра Лайн', NULL, '', 'text', 216, 'Великолепные туфли сдержанного дизайна. Модель выполнена из натуральной кожи благородного оттенка. Отличный вариант на каждый день. Подкладка: натуральная кожа. Высота каблука ок. 9,5 см.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Высота каблука:</b> Средний, 9.5 см</li>\n\n							<li><b>Материал верха:</b> Кожа</li>\n\n							<li><b>Материал стельки:</b> Кожа</li>\n\n							<li><b>Материал подкладки:</b> Кожа</li>\n\n							<li><b>По назначению: </b>Повседневные</li>\n\n							<li><b>Сезон:</b> лето</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Страна бренда:</b> Россия</li>\n\n							<li><b>Страна производитель:</b> Китай</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'ТУФЛИ УЛЬТРА ЛАЙН\r\n\r\nВЕЛИКОЛЕПНЫЕ ТУФЛИ СДЕРЖАННОГО ДИЗАЙНА. \r\nМОДЕЛЬ ВЫПОЛНЕНА ИЗ НАТУРАЛЬНОЙ КОЖИ БЛАГОРОДНОГО \r\nОТТЕНКА. ОТЛИЧНЫЙ ВАРИАНТ НА КАЖДЫЙ ДЕНЬ. \r\nПОДКЛАДКА: НАТУРАЛЬНАЯ КОЖА. ВЫСОТА КАБЛУКА \r\nОК. 9,5 СМ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ВЫСОТА КАБЛУКА: СРЕДНИЙ, 9.5 СМ \r\n- МАТЕРИАЛ ВЕРХА: КОЖА \r\n- МАТЕРИАЛ СТЕЛЬКИ: КОЖА \r\n- МАТЕРИАЛ ПОДКЛАДКИ: КОЖА \r\n- ПО НАЗНАЧЕНИЮ: ПОВСЕДНЕВНЫЕ \r\n- СЕЗОН: ЛЕТО \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: РОССИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: КИТАЙ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '520', 'shoes-ultra-line', '', '-243646618', NULL, NULL, NULL),
(36, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 14, 'Y', NULL, NULL, 360, 'Ремень Радуга', NULL, '', 'text', 217, 'Стильный текстильный ремень, декорированный полоской и фирменным логотипом. Застежка на металлическую пряжку. Отличный вариант на каждый день.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Габариты предметов:</b> Ширина, 4.0 см</li>\n\n							<li><b>Габариты предметов:</b> Длина, 105.0 см</li>\n\n							<li><b>Размер пряжки:</b> Маленькая, 3.0 см</li>\n\n							<li><b>Сезон:</b> демисезон</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Страна бренда:</b> Соединенные Штаты</li>\n\n							<li><b>Страна производитель:</b> Румыния</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'РЕМЕНЬ РАДУГА\r\n\r\nСТИЛЬНЫЙ ТЕКСТИЛЬНЫЙ РЕМЕНЬ, ДЕКОРИРОВАННЫЙ \r\nПОЛОСКОЙ И ФИРМЕННЫМ ЛОГОТИПОМ. ЗАСТЕЖКА \r\nНА МЕТАЛЛИЧЕСКУЮ ПРЯЖКУ. ОТЛИЧНЫЙ ВАРИАНТ \r\nНА КАЖДЫЙ ДЕНЬ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ШИРИНА, 4.0 СМ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 105.0 СМ \r\n- РАЗМЕР ПРЯЖКИ: МАЛЕНЬКАЯ, 3.0 СМ \r\n- СЕЗОН: ДЕМИСЕЗОН \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: СОЕДИНЕННЫЕ ШТАТЫ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РУМЫНИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '557', 'strap-rainbow', '', '1150168693', NULL, NULL, NULL),
(37, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 15, 'Y', NULL, NULL, 500, 'Ремень Классика', NULL, '', 'text', 218, 'Стильный и качественный ремень станет прекрасным завершение Вашего образа. Ширина ремня ок. 3,5 см, длина регулируется на уменьшение. Уход за изделием: натереть пряжку войлоком, кожу влажной тряпочкой.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Габариты предметов:</b> Ширина, 3.5 см</li>\n\n							<li><b>Габариты предметов:</b> Длина, 105.0 см</li>\n\n							<li><b>Размер пряжки:</b> Крупная, 7.0 см</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол:</b> Мужской</li>\n\n							<li><b>Страна бренда:</b> Италия</li>\n\n							<li><b>Страна производитель:</b> Италия</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'РЕМЕНЬ КЛАССИКА\r\n\r\nСТИЛЬНЫЙ И КАЧЕСТВЕННЫЙ РЕМЕНЬ СТАНЕТ \r\nПРЕКРАСНЫМ ЗАВЕРШЕНИЕ ВАШЕГО ОБРАЗА. ШИРИНА \r\nРЕМНЯ ОК. 3,5 СМ, ДЛИНА РЕГУЛИРУЕТСЯ НА УМЕНЬШЕНИЕ. \r\nУХОД ЗА ИЗДЕЛИЕМ: НАТЕРЕТЬ ПРЯЖКУ ВОЙЛОКОМ, \r\nКОЖУ ВЛАЖНОЙ ТРЯПОЧКОЙ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ШИРИНА, 3.5 СМ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 105.0 СМ \r\n- РАЗМЕР ПРЯЖКИ: КРУПНАЯ, 7.0 СМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: МУЖСКОЙ \r\n- СТРАНА БРЕНДА: ИТАЛИЯ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: ИТАЛИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '601', 'strap-classics', '', '141028312', NULL, NULL, NULL),
(38, '2017-09-20 17:00:21', 1, '2017-09-20 17:00:20', 1, 2, 14, 'Y', NULL, NULL, 500, 'Ремень Элегантность', NULL, '', 'text', 224, 'Оригинальный кожаный ремень с изящной пряжкой. Будет великолепно смотреться с Вашим модным нарядом, идеально дополнит повседневный образ. Ремень регулируется по длине.\n							<div>\n							<br />\n							</div>\n\n							<div>\n							<div><b>Дополнительное описание:</b></div>\n\n							<div>\n							<ul>\n							<li><b>Габариты предметов:</b> Ширина, 2.5 см</li>\n\n							<li><b>Габариты предметов:</b> Длина, 98.0 см</li>\n\n							<li><b>Размер пряжки:</b> Маленькая, 3.5 см</li>\n\n							<li><b>Сезон:</b> круглогодичный</li>\n\n							<li><b>Пол:</b> Женский</li>\n\n							<li><b>Страна бренда:</b> Соединенные Штаты</li>\n\n							<li><b>Страна производитель:</b> Румыния</li>\n							</ul>\n							</div>\n							</div>\n						', 'html', 'РЕМЕНЬ ЭЛЕГАНТНОСТЬ\r\n\r\nОРИГИНАЛЬНЫЙ КОЖАНЫЙ РЕМЕНЬ С ИЗЯЩНОЙ \r\nПРЯЖКОЙ. БУДЕТ ВЕЛИКОЛЕПНО СМОТРЕТЬСЯ С \r\nВАШИМ МОДНЫМ НАРЯДОМ, ИДЕАЛЬНО ДОПОЛНИТ \r\nПОВСЕДНЕВНЫЙ ОБРАЗ. РЕМЕНЬ РЕГУЛИРУЕТСЯ \r\nПО ДЛИНЕ. \r\nДОПОЛНИТЕЛЬНОЕ ОПИСАНИЕ: \r\n\r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ШИРИНА, 2.5 СМ \r\n- ГАБАРИТЫ ПРЕДМЕТОВ: ДЛИНА, 98.0 СМ \r\n- РАЗМЕР ПРЯЖКИ: МАЛЕНЬКАЯ, 3.5 СМ \r\n- СЕЗОН: КРУГЛОГОДИЧНЫЙ \r\n- ПОЛ: ЖЕНСКИЙ \r\n- СТРАНА БРЕНДА: СОЕДИНЕННЫЕ ШТАТЫ \r\n- СТРАНА ПРОИЗВОДИТЕЛЬ: РУМЫНИЯ', 1, NULL, NULL, NULL, NULL, NULL, 'Y', '610', 'strap-elegance', '', '-419388334', NULL, NULL, NULL),
