INSERT INTO `b_iblock_section` VALUES
(1, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 50, 'Обувь', 32, 1, 12, 1, 'Сложно представить себе элементы гардероба современного человека, которые выбирались бы более тщательно и основательно, чем обувь. Это больше, чем просто стильный аксессуар: ботинки, сапоги, туфли и другие модели выполняют очень важную функцию – они отвечают за комфорт, а иногда и за здоровье ног.<br />\n					<br />\n				', 'html', 'ОБУВЬ\r\nСЛОЖНО ПРЕДСТАВИТЬ СЕБЕ ЭЛЕМЕНТЫ ГАРДЕРОБА \r\nСОВРЕМЕННОГО ЧЕЛОВЕКА, КОТОРЫЕ ВЫБИРАЛИСЬ \r\nБЫ БОЛЕЕ ТЩАТЕЛЬНО И ОСНОВАТЕЛЬНО, ЧЕМ ОБУВЬ. \r\nЭТО БОЛЬШЕ, ЧЕМ ПРОСТО СТИЛЬНЫЙ АКСЕССУАР: \r\nБОТИНКИ, САПОГИ, ТУФЛИ И ДРУГИЕ МОДЕЛИ ВЫПОЛНЯЮТ \r\nОЧЕНЬ ВАЖНУЮ ФУНКЦИЮ – ОНИ ОТВЕЧАЮТ ЗА \r\nКОМФОРТ, А ИНОГДА И ЗА ЗДОРОВЬЕ НОГ.', 'shoes', '19', NULL, NULL, NULL),
(2, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 1, 'Y', 'Y', 500, 'Пантолеты', 34, 2, 3, 2, 'Женские пантолеты – обувь, которая только с виду кажется непрактичной и простой. На самом деле, эти легкие и изящные шлепанцы универсальны: современные девушки все чаще выбирают их не только в качестве пляжной обуви, но и как удобный вариант на каждый день. Конечно, такая обувь в рамках офисного образа вряд ли станет удачным решением, однако в остальном у представительниц прекрасного пола – абсолютная свобода выбора.<br />\n							<br />\n						', 'html', 'ПАНТОЛЕТЫ\r\nЖЕНСКИЕ ПАНТОЛЕТЫ – ОБУВЬ, КОТОРАЯ ТОЛЬКО \r\nС ВИДУ КАЖЕТСЯ НЕПРАКТИЧНОЙ И ПРОСТОЙ. НА \r\nСАМОМ ДЕЛЕ, ЭТИ ЛЕГКИЕ И ИЗЯЩНЫЕ ШЛЕПАНЦЫ \r\nУНИВЕРСАЛЬНЫ: СОВРЕМЕННЫЕ ДЕВУШКИ ВСЕ ЧАЩЕ \r\nВЫБИРАЮТ ИХ НЕ ТОЛЬКО В КАЧЕСТВЕ ПЛЯЖНОЙ \r\nОБУВИ, НО И КАК УДОБНЫЙ ВАРИАНТ НА КАЖДЫЙ \r\nДЕНЬ. КОНЕЧНО, ТАКАЯ ОБУВЬ В РАМКАХ ОФИСНОГО \r\nОБРАЗА ВРЯД ЛИ СТАНЕТ УДАЧНЫМ РЕШЕНИЕМ, \r\nОДНАКО В ОСТАЛЬНОМ У ПРЕДСТАВИТЕЛЬНИЦ ПРЕКРАСНОГО \r\nПОЛА – АБСОЛЮТНАЯ СВОБОДА ВЫБОРА.', 'pantolety', '26', NULL, NULL, NULL),
(3, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 1, 'Y', 'Y', 500, 'Тапочки', 35, 4, 5, 2, 'Яркие, удобные женские и мужские тапочки: для домашнего уюта и полноценного отдыха. Эта обувь помогает расслабиться после тяжелого и напряженного дня.\n							</br></br>\n							Так приятно, придя домой, сменить тесные туфли или туфли на высоком каблуке на комфортные тапочки.\n							</br></br>', 'html', 'ТАПОЧКИ\r\nЯРКИЕ, УДОБНЫЕ ЖЕНСКИЕ И МУЖСКИЕ ТАПОЧКИ: \r\nДЛЯ ДОМАШНЕГО УЮТА И ПОЛНОЦЕННОГО ОТДЫХА. \r\nЭТА ОБУВЬ ПОМОГАЕТ РАССЛАБИТЬСЯ ПОСЛЕ ТЯЖЕЛОГО \r\nИ НАПРЯЖЕННОГО ДНЯ. ТАК ПРИЯТНО, ПРИДЯ ДОМОЙ, \r\nСМЕНИТЬ ТЕСНЫЕ ТУФЛИ ИЛИ ТУФЛИ НА ВЫСОКОМ \r\nКАБЛУКЕ НА КОМФОРТНЫЕ ТАПОЧКИ.', 'slippers', '32', NULL, NULL, NULL),
(4, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 1, 'Y', 'Y', 500, 'Туфли', 36, 6, 11, 2, '<br />\n							<br />\n						', 'html', 'ТУФЛИ\r\n', 'shoess', '29', NULL, NULL, NULL),
(5, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 4, 'Y', 'Y', 500, ' Туфли Женские', 37, 7, 8, 3, 'Считается, что женские туфли – это своеобразный «индикатор» наличия у девушки вкуса. Неправильно выбранная обувь может свести на нет все усилия по составлению эффектного и стильного образа. В то время как удачно выбранные женские туфли станут ярким акцентом даже самого скромного ансамбля.', 'html', ' ТУФЛИ ЖЕНСКИЕ\r\nСЧИТАЕТСЯ, ЧТО ЖЕНСКИЕ ТУФЛИ – ЭТО СВОЕОБРАЗНЫЙ \r\n«ИНДИКАТОР» НАЛИЧИЯ У ДЕВУШКИ ВКУСА. НЕПРАВИЛЬНО \r\nВЫБРАННАЯ ОБУВЬ МОЖЕТ СВЕСТИ НА НЕТ ВСЕ \r\nУСИЛИЯ ПО СОСТАВЛЕНИЮ ЭФФЕКТНОГО И СТИЛЬНОГО \r\nОБРАЗА. В ТО ВРЕМЯ КАК УДАЧНО ВЫБРАННЫЕ \r\nЖЕНСКИЕ ТУФЛИ СТАНУТ ЯРКИМ АКЦЕНТОМ ДАЖЕ \r\nСАМОГО СКРОМНОГО АНСАМБЛЯ.', 'women-s-shoes', '31', NULL, NULL, NULL),
(6, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 4, 'Y', 'Y', 500, 'Туфли Мужские', 38, 9, 10, 3, 'Мужская обувь, предлагаемая современными брендами представителям сильного пола, невероятно разнообразна. Касается это не только огромного количества всевозможных форм, но и различных стилевых отличий. Дело в том, что сегодня стало невероятно популярным смешение различных направлений и стилей, поэтому иногда даже в самых строгих ботинках можно найти легкие спортивные нотки.<br />\n								', 'html', 'ТУФЛИ МУЖСКИЕ\r\nМУЖСКАЯ ОБУВЬ, ПРЕДЛАГАЕМАЯ СОВРЕМЕННЫМИ \r\nБРЕНДАМИ ПРЕДСТАВИТЕЛЯМ СИЛЬНОГО ПОЛА, \r\nНЕВЕРОЯТНО РАЗНООБРАЗНА. КАСАЕТСЯ ЭТО НЕ \r\nТОЛЬКО ОГРОМНОГО КОЛИЧЕСТВА ВСЕВОЗМОЖНЫХ \r\nФОРМ, НО И РАЗЛИЧНЫХ СТИЛЕВЫХ ОТЛИЧИЙ. ДЕЛО \r\nВ ТОМ, ЧТО СЕГОДНЯ СТАЛО НЕВЕРОЯТНО ПОПУЛЯРНЫМ \r\nСМЕШЕНИЕ РАЗЛИЧНЫХ НАПРАВЛЕНИЙ И СТИЛЕЙ, \r\nПОЭТОМУ ИНОГДА ДАЖЕ В САМЫХ СТРОГИХ БОТИНКАХ \r\nМОЖНО НАЙТИ ЛЕГКИЕ СПОРТИВНЫЕ НОТКИ.', 'shoes-mens', '30', NULL, NULL, NULL),
(7, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 100, 'Платья', 39, 13, 14, 1, NULL, 'text', 'ПЛАТЬЯ\r\n', 'dresses', '20', NULL, NULL, NULL),
(8, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 200, 'Штаны', 41, 15, 16, 1, NULL, 'text', 'ШТАНЫ\r\n', 'pants', '25', NULL, NULL, NULL),
(9, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 300, 'Нижнее белье', 42, 17, 18, 1, NULL, 'text', 'НИЖНЕЕ БЕЛЬЕ\r\n', 'underwear', '23', NULL, NULL, NULL),
(10, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 400, 'Футболки', 43, 19, 20, 1, NULL, 'text', 'ФУТБОЛКИ\r\n', 't-shirts', '22', NULL, NULL, NULL),
(11, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 500, 'Спортивная Одежда', 45, 21, 22, 1, NULL, 'text', 'СПОРТИВНАЯ ОДЕЖДА\r\n', 'sportswear', '21', NULL, NULL, NULL),
(12, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, NULL, 'Y', 'Y', 700, 'Аксессуары', 46, 23, 30, 1, 'Без аксессуаров вряд ли получится создать стильный, завершенный и индивидуальный образ. Важно обращать внимание на то, насколько гармонично такие элементы будут смотреться в сочетании с тем или иным стилем в одежде, в рамках какого-либо мероприятия.<br />\n				', 'html', 'АКСЕССУАРЫ\r\nБЕЗ АКСЕССУАРОВ ВРЯД ЛИ ПОЛУЧИТСЯ СОЗДАТЬ \r\nСТИЛЬНЫЙ, ЗАВЕРШЕННЫЙ И ИНДИВИДУАЛЬНЫЙ \r\nОБРАЗ. ВАЖНО ОБРАЩАТЬ ВНИМАНИЕ НА ТО, НАСКОЛЬКО \r\nГАРМОНИЧНО ТАКИЕ ЭЛЕМЕНТЫ БУДУТ СМОТРЕТЬСЯ \r\nВ СОЧЕТАНИИ С ТЕМ ИЛИ ИНЫМ СТИЛЕМ В ОДЕЖДЕ, \r\nВ РАМКАХ КАКОГО-ЛИБО МЕРОПРИЯТИЯ.', 'accessories', '24', NULL, NULL, NULL),
(13, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 12, 'Y', 'Y', 500, 'Ремни', 47, 24, 29, 2, 'Модные женские пояса и ремни – это атрибут современной и стильной женщины, а также часть тщательно продуманного наряда. Придерживают ли они брюки на своем месте или эффектно подчеркивают талию, выполняют декоративную функцию или чисто практичную – не важно. ', 'html', 'РЕМНИ\r\nМОДНЫЕ ЖЕНСКИЕ ПОЯСА И РЕМНИ – ЭТО АТРИБУТ \r\nСОВРЕМЕННОЙ И СТИЛЬНОЙ ЖЕНЩИНЫ, А ТАКЖЕ \r\nЧАСТЬ ТЩАТЕЛЬНО ПРОДУМАННОГО НАРЯДА. ПРИДЕРЖИВАЮТ \r\nЛИ ОНИ БРЮКИ НА СВОЕМ МЕСТЕ ИЛИ ЭФФЕКТНО \r\nПОДЧЕРКИВАЮТ ТАЛИЮ, ВЫПОЛНЯЮТ ДЕКОРАТИВНУЮ \r\nФУНКЦИЮ ИЛИ ЧИСТО ПРАКТИЧНУЮ – НЕ ВАЖНО.', 'belts', '33', NULL, NULL, NULL),
(14, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 13, 'Y', 'Y', 500, 'Ремни Женские', 48, 25, 26, 3, 'Женские ремни – это атрибут современной женщины, а также часть тщательно продуманного наряда. Придерживают ли они брюки на своем месте или эффектно подчеркивают талию, выполняют декоративную функцию или чисто практичную. Главное заключается в том, что для женщин ремень – это один из самых значимых аксессуаров. ', 'html', 'РЕМНИ ЖЕНСКИЕ\r\nЖЕНСКИЕ РЕМНИ – ЭТО АТРИБУТ СОВРЕМЕННОЙ \r\nЖЕНЩИНЫ, А ТАКЖЕ ЧАСТЬ ТЩАТЕЛЬНО ПРОДУМАННОГО \r\nНАРЯДА. ПРИДЕРЖИВАЮТ ЛИ ОНИ БРЮКИ НА СВОЕМ \r\nМЕСТЕ ИЛИ ЭФФЕКТНО ПОДЧЕРКИВАЮТ ТАЛИЮ, \r\nВЫПОЛНЯЮТ ДЕКОРАТИВНУЮ ФУНКЦИЮ ИЛИ ЧИСТО \r\nПРАКТИЧНУЮ. ГЛАВНОЕ ЗАКЛЮЧАЕТСЯ В ТОМ, ЧТО \r\nДЛЯ ЖЕНЩИН РЕМЕНЬ – ЭТО ОДИН ИЗ САМЫХ ЗНАЧИМЫХ \r\nАКСЕССУАРОВ.', 'women-s-belts', '34', NULL, NULL, NULL),
(15, '2017-09-20 17:00:17', 1, '2017-09-20 17:00:17', 1, 2, 13, 'Y', 'Y', 500, 'Ремни Мужские', 49, 27, 28, 3, 'Стильные и качественные мужские ремни – обязательные аксессуары в гардеробе каждого современного представителя сильного пола, внимательно относящегося к своему внешнему виду. Правильно выбранный ремень поможет сделать образ завершенным, респектабельным и солидным.', 'html', 'РЕМНИ МУЖСКИЕ\r\nСТИЛЬНЫЕ И КАЧЕСТВЕННЫЕ МУЖСКИЕ РЕМНИ \r\n– ОБЯЗАТЕЛЬНЫЕ АКСЕССУАРЫ В ГАРДЕРОБЕ \r\nКАЖДОГО СОВРЕМЕННОГО ПРЕДСТАВИТЕЛЯ СИЛЬНОГО \r\nПОЛА, ВНИМАТЕЛЬНО ОТНОСЯЩЕГОСЯ К СВОЕМУ \r\nВНЕШНЕМУ ВИДУ. ПРАВИЛЬНО ВЫБРАННЫЙ РЕМЕНЬ \r\nПОМОЖЕТ СДЕЛАТЬ ОБРАЗ ЗАВЕРШЕННЫМ, РЕСПЕКТАБЕЛЬНЫМ \r\nИ СОЛИДНЫМ.', 'men-s-belts', '35', NULL, NULL, NULL);
