(7, '', 4, 'Зебра-онлайн', 'N', 'Экономичная доставка', 100, NULL, 'a:1:{s:4:\"MAIN\";a:3:{s:12:\"SERVICE_TYPE\";i:36;s:17:\"SERVICE_TYPE_NAME\";s:23:\"Зебра-онлайн\";s:17:\"DESCRIPTION_INNER\";s:329:\"Это экономичная услуга для интернет-магазинов и компаний дистанционной торговли по доставке товаров (оплаченных заранее или оплачиваемых в момент вручения) наземным транспортом\";}}', '\\Sale\\Handlers\\Delivery\\SpsrProfile', 'RUB', NULL, 'Y'),
(8, '', 4, 'Колибри-Документ', 'N', 'Мгновенная доставка документов по России', 100, NULL, 'a:1:{s:4:\"MAIN\";a:3:{s:12:\"SERVICE_TYPE\";i:20;s:17:\"SERVICE_TYPE_NAME\";s:31:\"Колибри-Документ\";s:17:\"DESCRIPTION_INNER\";s:848:\"Количество мест по одной накладной - 1. Вес - до 0,4 кг включительно с учетом веса упаковки. Отправление может содержать документы и печатную продукцию (только на бумажных носителях). Срок доставки: на следующий возможный рабочий день. География: свыше 130 населенных пунктов России. Фиксированный тариф (не зависит от города Отправителя и города Получателя) - 385 рублей (без НДС). К доставке принимаются отправления в картонном конверте под формат А4 (формат конверта С4).\";}}', '\\Sale\\Handlers\\Delivery\\SpsrProfile', 'RUB', NULL, 'Y'),
(9, '', 4, 'ГЕПАРД-Экспресс 13', 'N', 'Самая быстрая доставка посылок в стране', 100, NULL, 'a:1:{s:4:\"MAIN\";a:3:{s:12:\"SERVICE_TYPE\";i:21;s:17:\"SERVICE_TYPE_NAME\";s:32:\"ГЕПАРД-Экспресс 13\";s:17:\"DESCRIPTION_INNER\";s:815:\"Количество мест: без ограничений. Общий вес отправления: не более 31,5 кг. Ограничение по габаритам: сумма измерений всех мест по одной накладной не должна превышать 150 см. Срок доставки: на следующий возможный рабочий день. География: свыше 6 000 населенных пунктов России. Отправление может содержать документы и печатную продукцию, товары народного потребления, электронику, технику (без ГСМ, в единичном количестве, до 9-ти штук одного вида товара).\";}}', '\\Sale\\Handlers\\Delivery\\SpsrProfile', 'RUB', NULL, 'Y'),
