(12, '', 4, 'Пеликан-Стандарт', 'N', 'Экспресс-доставка Ваших посылок', 100, NULL, 'a:1:{s:4:\"MAIN\";a:3:{s:12:\"SERVICE_TYPE\";i:24;s:17:\"SERVICE_TYPE_NAME\";s:31:\"Пеликан-Стандарт\";s:17:\"DESCRIPTION_INNER\";s:1103:\"Количество мест: не ограничено. Общий вес отправления: не ограничен. Ограничение по габаритам: сумма измерений одно места не должна превышать 180 см. Максимальный физический вес одного места: не ограничен. Объемный вес одного места: не ограничен. Максимальный объем партии по одной накладной: не ограничен. Срок доставки: в зависимости от направления, уточняйте в ближайшем офисе СПСР-Экспресс или в тарифном калькуляторе на сайте. География обслуживания: свыше 6 000 населенных пунктов России. Отправление может содержать любые материалы, оборудование и товары, разрешенные к авиа-, авто- или ж/д перевозке.\";}}', '\\Sale\\Handlers\\Delivery\\SpsrProfile', 'RUB', NULL, 'Y'),
