(14, '', 4, 'Бизон-Карго', 'N', 'Экспресс-доставка крупногабаритных отправлений', 100, NULL, 'a:1:{s:4:\"MAIN\";a:3:{s:12:\"SERVICE_TYPE\";i:26;s:17:\"SERVICE_TYPE_NAME\";s:21:\"Бизон-Карго\";s:17:\"DESCRIPTION_INNER\";s:721:\"Виды транспортировки: авто-, ж/д транспорт - для всех почтовых округов кроме Дальневосточного почтового округа. Максимальный физический вес одного места - 1000 кг. Количество мест по накладной не ограничено, с учётом других имеющихся ограничений. Минимальный тарифицируемый вес - 68 кг. Отправление может содержать любые материалы, оборудование и товары, разрешенные к авто-, ж/д- или авиаперевозке.\";}}', '\\Sale\\Handlers\\Delivery\\SpsrProfile', 'RUB', NULL, 'Y'),
(15, '', 4, 'Фрахт', 'N', 'Оптимальные решения доставки нестандартных грузов', 100, NULL, 'a:1:{s:4:\"MAIN\";a:3:{s:12:\"SERVICE_TYPE\";i:27;s:17:\"SERVICE_TYPE_NAME\";s:10:\"Фрахт\";s:17:\"DESCRIPTION_INNER\";s:727:\"Виды транспортировки: авиа-, авто-, ж/д транспорт. Максимальный физический вес одного места - ограничен существующими перевозными квотами и характеристиками транспорта. Количество мест по накладной не ограничено, с учётом других имеющихся ограничений. Минимальный тарифицируемый вес - 68 кг. Отправление может содержать любые материалы, оборудование и товары, разрешенные к авто- или ж/д перевозке.\";}}', '\\Sale\\Handlers\\Delivery\\SpsrProfile', 'RUB', NULL, 'Y');
