INSERT INTO `b_sale_pay_system_action` VALUES
(1, 1, NULL, 'Наличные курьеру', 'Наличные курьеру', NULL, 80, 'Оплата производится наличными деньгами, в момент получения заказа. Подтверждением вашей оплаты является фискальный кассовый чек, вручаемый во время получения и оплаты заказа.', 'cash', '', 'N', 'Y', NULL, 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:1;}', NULL, 'Y', 'N', 'N', 'N', 'N', 'N', 'N', 'Y', NULL, 933, 'N', 'N'),
(2, 2, NULL, 'Наложенный платеж', 'Наложенный платеж', NULL, 110, 'Оплата производится в момент получения заказа. Подтверждением вашей оплаты является фискальный кассовый чек, вручаемый во время получения и оплаты заказа.', 'cashondeliverycalc', '', 'N', 'Y', NULL, 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:2;}', NULL, 'Y', 'N', 'N', 'N', 'N', 'N', 'N', 'Y', NULL, 934, 'N', 'N'),
(3, 3, NULL, 'Яндекс.Деньги', 'Яндекс.Деньги', NULL, 50, 'Оплата производится Яндекс деньгами, через сервис Яндекс.Касса. Подтверждением вашей оплаты является электронное почтовое уведомление, пришедшее после оплаты.', 'yandex', '', 'N', 'Y', 'PC', 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:3;}', NULL, 'Y', 'N', 'N', 'N', 'N', 'N', 'Y', 'Y', NULL, 935, 'N', 'N'),
(4, 4, NULL, 'Банковские карты', 'Банковские карты', NULL, 60, 'Оплата производится банковской картой через сервис Яндекс.Касса. Подтверждением вашей оплаты является электронное почтовое уведомление, пришедшее после оплаты.', 'yandex', '', 'N', 'Y', 'AC', 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:4;}', NULL, 'Y', 'N', 'N', 'N', 'N', 'N', 'Y', 'Y', NULL, 936, 'N', 'N'),
(5, 5, NULL, 'Терминалы', 'Терминалы', NULL, 70, 'Оплата производится через Терминалы с использованием сервиса Яндекс.Касса. Подтверждением вашей оплаты является электронное почтовое уведомление, пришедшее после оплаты.', 'yandex', '', 'N', 'Y', NULL, 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:5;}', NULL, 'Y', 'N', 'N', 'N', 'N', 'N', 'Y', 'Y', NULL, 937, 'N', 'N'),
(6, 6, NULL, 'Оплата в платежной системе Web Money', 'Оплата в платежной системе Web Money', NULL, 90, 'Авторизация будет производится через процессинговый центр Assist.', 'webmoney', '', 'Y', 'N', NULL, 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:6;}', NULL, 'Y', 'N', 'N', 'Y', 'N', 'N', 'N', 'Y', NULL, 938, 'N', 'N'),
(7, 7, NULL, 'Сбербанк', 'Сбербанк', NULL, 110, 'Вы можете оплатить заказ в любом отделении Сбербанка. За услугу по переводу денег с Вас возьмут от 3 до 7% от стоимости заказа, в зависимости от региона. Перечисление денег займет до 10 дней.', 'sberbank', '', 'Y', 'Y', NULL, 'a:1:{s:16:\"BX_PAY_SYSTEM_ID\";i:7;}', NULL, 'Y', 'N', 'N', 'N', 'N', 'N', 'N', 'Y', NULL, 939, 'N', 'N'),
(8, NULL, NULL, 'Внутренний счет', 'Внутренний счет', NULL, 100, NULL, 'inner', NULL, 'N', 'Y', NULL, NULL, NULL, 'N', 'N', 'N', 'N', 'N', 'N', 'N', 'Y', NULL, 940, 'N', 'N');
